(22020, 366, 'thankyou_content', '<h2>Step One:</h2>\r\nWe are thrilled to have you on board as a new user of Zenzio! To ensure a smooth start, please check your email for login information within the next 24 hours. This will provide you with access to all of the platform\'s features and tools.\r\n<h2>Step Two:</h2>\r\nTo fully utilize the capabilities of Zenzio, we recommend that you take a moment to watch our dashboard demo. This will give you a comprehensive understanding of the platform\'s features and how to navigate them. Alternatively, if you prefer a more personalized experience, one of our experts would be happy to schedule a call with you through this calendly link: <a href=\"https://calendly.com/vluquis/30min\" target=\"_blank\" rel=\"noopener\">https://calendly.com/vluquis/30min</a>\r\n<h2>Step Three:</h2>\r\nNow that you have received your login information and have familiarized yourself with the platform, it\'s time to start automating your posts. Log in to your account and take advantage of all the time-saving tools and features that Zenzio has to offer. We are confident that you will find our platform to be an invaluable asset in your social media management.'),
