(24944, 421, 'testimonials_0_star', '72'),
(24945, 421, '_testimonials_0_star', 'field_63c7e7daeb430'),
(24946, 421, 'testimonials_0_content', '<p>I highly recommend Zenzio for agents on the go. I\'ve been using it for about a month now and it has been helping me with lead generation and keeping my social media fresh.</p>'),
(24947, 421, '_testimonials_0_content', 'field_63c7e7efeb431'),
