(24969, 421, '_testimonials_2_star', 'field_63c7e7daeb430'),
(24970, 421, 'testimonials_2_content', '<p>I love how easy Zenzio makes it to create great content and share it with my audience. The best part is that I am not stuck creating more content than I have time for.</p>'),
(24971, 421, '_testimonials_2_content', 'field_63c7e7efeb431'),
(24972, 421, 'testimonials_2_name', 'Jennifer S.'),
(24973, 421, '_testimonials_2_name', 'field_63c7e7fdeb432'),
(24974, 421, 'testimonials_2_designation', 'Fathom Realty'),
