(25029, 421, '_realtor_section_realtor_content_2_title', 'field_63c8de65b4922'),
(25030, 421, 'realtor_section_realtor_content_2_content', '<p>Schedule your engaging posts, personalize them with your branding, and start generating leads!</p>'),
(25031, 421, '_realtor_section_realtor_content_2_content', 'field_63c8de6db4923'),
(25032, 421, 'realtor_section_realtor_content', '3'),
(25033, 421, '_realtor_section_realtor_content', 'field_63c8ddf6b491f'),
(25034, 421, 'realtor_section', ''),
(25035, 421, '_realtor_section', 'field_63c8dd7db491d'),
(25036, 421, 'realtor_section_bottom_section', 'See how effortless your social media journey will become\r\n\r\n<a class=\"btn btnBig\" href=\"#videoSection\">watch now</a>'),
(25037, 421, '_realtor_section_bottom_section', 'field_63c8e2368ccb2'),
(25038, 421, 'success_section_bottom_content', 'You’re a realtor trying to balance content marketing AND real estate. You just can’t compete, and that’s not your fault.\r\n\r\nThat’s why Zenzio does it for you, without you having to hire an expensive marketing consultancy.\r\n\r\nOur marketing professionals do what an agency would do, at a fraction of the cost. So you can get powerful unique content at the click of a button, without selling your kidney.'),
(25039, 421, '_success_section_bottom_content', 'field_63c90ecbf7adf'),
(25040, 421, 'now_never_section_left_content', '<p>If you find Zenzio isn’t for you, you can cancel anytime with a <span>14-day 100% money-back guarantee</span> - no hassle, no questions asked</p>\r\n<ul>\r\n<li><span>Step 1.</span> Click cancel subscription</li>\r\n<li><span>Step 2.</span> Get your 100% refund</li>\r\n<li><span>Step 3.</span> (There is no step 3)</li>\r\n</ul>\r\n<a href=\"#\" class=\"btn\">Sign Up Now</a>'),
(25041, 421, '_now_never_section_left_content', 'field_63c90fda991ca'),
(25042, 421, 'content_creation_right_content', ''),
(25043, 421, '_content_creation_right_content', 'field_63c910083bbbd'),
(25044, 421, 'now_never_section_bottom_left_content', '<p>If you find Zenzio isn’t for you, you can cancel anytime with a <span>14-day 100% money-back guarantee</span> - no hassle, no questions asked</p>\r\n<ul>\r\n<li><span>Step 1.</span> Click cancel subscription</li>\r\n<li><span>Step 2.</span> Get your 100% refund</li>\r\n<li><span>Step 3.</span> (There is no step 3)</li>\r\n</ul>\r\n<a href=\"#getStartSection\" class=\"btn btnBig\">Sign Up Now</a>'),
(25045, 421, '_now_never_section_bottom_left_content', 'field_63c911b037a55'),
(25046, 421, 'now_never_section_bottom_right_content', '<h3>We want you to be as confident as we are that Zenzio will:</h3>\r\n<ul>\r\n 	<li>Remove the frustrations of content marketing from your life</li>\r\n 	<li>Free you up to spend more time with family and friends</li>\r\n 	<li>Give you more time to focus on what you do best - help your clients find homes!</li>\r\n</ul>'),
(25047, 421, '_now_never_section_bottom_right_content', 'field_63c911bf37a56'),
(25048, 421, 'content_creation_bottom_content', 'That was the last soul-crushing straw. I promised myself I was done wasting time on trying to do my own social media posts, or any marketing for that matter.\r\n\r\nI wasn’t just wasting my time on disappointing results, but I was getting close to zero time with my kids I switched from looking up “How to create powerful Facebook posts” to “Marketing agency near me” I realized very quickly that I didn’t want to pay an arm and a leg for a marketing agency.\r\n\r\nAnd just as I was about to go back to my disappointing world of hoping and trying to create content myself - I found Zenzio.\r\n\r\nAnd I haven’t looked back. 5 years later, I really can’t imagine what my life would look like if I was still spending god knows how many hours trying to make my own content.\r\n\r\nI never realized just how much time I wasted until it was given back to me, and I can honestly say Zenzio has given me back time I can spend with my kids, and a hyper focus on helping my clients.'),
(25049, 421, '_content_creation_bottom_content', 'field_63c910083bbbd'),
(25050, 421, 'realtor_section_realtor_steps', '<h3>That\'s it!</h3>\r\n<ul>\r\n 	<li>1 steps to save you thousands of hours creating content</li>\r\n 	<li>2 steps to save you from competing with marketing experts</li>\r\n 	<li>3 steps to get you more time with family, and less time being frustrated</li>\r\n</ul>'),
(25051, 421, '_realtor_section_realtor_steps', 'field_63c9230cc1c7e'),
