INSERT INTO `wp_postmeta` (`meta_id`, `post_id`, `meta_key`, `meta_value`) VALUES
(25096, 421, 'your_sanity_section_top_section', '<h2>Sometimes All You Have to Lose is Your Sanity</h2>\r\nYou don\'t need to drive yourself crazy trying to learn and create content. But, we\'re not\r\ngoing to tell you how to live your life.\r\n\r\n<em>We\'re not going to say you need Zenzio, but what we will tell you is this:</em>'),
(25097, 421, '_your_sanity_section_top_section', 'field_63c938a63de24'),
(25098, 421, 'your_sanity_section_left_section', '<h3>You have a choice to make</h3>\r\n<ul>\r\n 	<li>You can do nothing, and nothing will change</li>\r\n 	<li>You can continue to do it yourself, and maybe something will change</li>\r\n 	<li>Or you can try Zenzio today, risk free, and everything will change</li>\r\n</ul>\r\n<a class=\"btn btnBig\" href=\"#getStartSection\">Sign Up Now</a>'),
(25099, 421, '_your_sanity_section_left_section', 'field_63c938dd3de25'),
(25100, 421, 'your_sanity_section_right_section', 'It\'s all up to you, and whatever you choose, we\'ll be rooting for you!\r\n\r\nIf you\'re ready, click the “Sign up” button below to check Zenzio out risk-free. Remember, if you find Zenzio isn\'t for you, you can cancel anytime.\r\n\r\nWith a 100% money-back NO HASSLE guarantee, for 14 days <span class=\"italic\">(You\'ll know within 5 minutes or less if Zenzio is for you)</span>'),
(25101, 421, '_your_sanity_section_right_section', 'field_63c938eb3de26'),
(25102, 421, 'your_sanity_section', ''),
(25103, 421, '_your_sanity_section', 'field_63c938733de23'),
(25104, 421, 'faq_section_title', 'Have Questions? You\'re in the Right Place'),
(25105, 421, '_faq_section_title', 'field_63c93e90086ef'),
(25106, 421, 'faq_section_faq_list_0_title', 'How do your services work?'),
(25107, 421, '_faq_section_faq_list_0_title', 'field_63c93eb9086f1'),
(25108, 421, 'faq_section_faq_list_0_content', '<p>You get full access to a personalized marketing content platform. Each month get access to new social content all done for you (the graphics, captions, and hashtags).You sync your accounts to start posting and scheduling content. Or with our managed plan, our team will manage your social media by using our content.</p>'),
(25109, 421, '_faq_section_faq_list_0_content', 'field_63c93ec3086f2'),
(25110, 421, 'faq_section_faq_list_1_title', 'How do your packages work?'),
(25111, 421, '_faq_section_faq_list_1_title', 'field_63c93eb9086f1'),
(25112, 421, 'faq_section_faq_list_1_content', '<p>You can subscribe on a monthly basis or join with an annual subscription for the self-service and managed plan.</p>'),
(25113, 421, '_faq_section_faq_list_1_content', 'field_63c93ec3086f2'),
(25114, 421, 'faq_section_faq_list_2_title', 'Can I schedule my posts in advance?'),
(25115, 421, '_faq_section_faq_list_2_title', 'field_63c93eb9086f1'),
(25116, 421, 'faq_section_faq_list_2_content', '<p>Yes, we have a scheduling feature available in the platform where you can set the time and day for each individual post to go out. You\'ll have visibility on scheduled posts that are pending for the upcoming week or month.</p>'),
(25117, 421, '_faq_section_faq_list_2_content', 'field_63c93ec3086f2'),
(25118, 421, 'faq_section_faq_list_3_title', 'Can I edit my captions and hashtags?'),
(25119, 421, '_faq_section_faq_list_3_title', 'field_63c93eb9086f1'),
(25120, 421, 'faq_section_faq_list_3_content', '<p>Yes, you can always make changes to the pre-written captions and hashtags. You can copy it in the dashboard and then paste it into a notepad or respective social media platform, and make the manual changes. <em>(The dashboard doesn\'t currently support text changes in the platform at this time, but we are working on this in the coming months.)</em></p>'),
(25121, 421, '_faq_section_faq_list_3_content', 'field_63c93ec3086f2'),
(25122, 421, 'faq_section_faq_list_4_title', 'Which social media platform does the platform allow me to post to?'),
(25123, 421, '_faq_section_faq_list_4_title', 'field_63c93eb9086f1'),
(25124, 421, 'faq_section_faq_list_4_content', '<p>You can sync up the following accounts: Instagram Business, Facebook Business, and LinkedIn. In the near future Twitter and TikTok.</p>'),
(25125, 421, '_faq_section_faq_list_4_content', 'field_63c93ec3086f2'),
(25126, 421, 'faq_section_faq_list_5_title', 'What are hashtags for?'),
(25127, 421, '_faq_section_faq_list_5_title', 'field_63c93eb9086f1'),
(25128, 421, 'faq_section_faq_list_5_content', '<p>Hashtags help your posts gain visibility as people search for your keywords and related keywords on social media. It helps feed the algorithm but also helps you attract a more niche audience to your posts and profile by attracting</p>'),
(25129, 421, '_faq_section_faq_list_5_content', 'field_63c93ec3086f2'),
(25130, 421, 'faq_section_faq_list_6_title', 'So do I still have to write my captions?'),
(25131, 421, '_faq_section_faq_list_6_title', 'field_63c93eb9086f1'),
(25132, 421, 'faq_section_faq_list_6_content', '<p>Nope, we have the captions and hashtags written for you.</p>'),
(25133, 421, '_faq_section_faq_list_6_content', 'field_63c93ec3086f2'),
(25134, 421, 'faq_section_faq_list_7_title', 'Do I still have to log in and schedule the posts or does someone on the Zenzio team post for me?'),
(25135, 421, '_faq_section_faq_list_7_title', 'field_63c93eb9086f1'),
(25136, 421, 'faq_section_faq_list_7_content', '<p>Depends on the plan you choose, but we can arrange to manage your social media.</p>'),
(25137, 421, '_faq_section_faq_list_7_content', 'field_63c93ec3086f2'),
(25138, 421, 'faq_section_faq_list_8_title', 'Can I customize the posts?'),
(25139, 421, '_faq_section_faq_list_8_title', 'field_63c93eb9086f1'),
(25140, 421, 'faq_section_faq_list_8_content', '<p>At this time, our posts are pre-designed for a more hands off approach. You can customize it by adding in your branding: brokerage logo or headshot. We are always open to feedback on content style.</p>'),
(25141, 421, '_faq_section_faq_list_8_content', 'field_63c93ec3086f2'),
(25142, 421, 'faq_section_faq_list_9_title', 'Do you connect with my CRM for email campaigns? Can you launch the emails from the dashboard?'),
(25143, 421, '_faq_section_faq_list_9_title', 'field_63c93eb9086f1'),
(25144, 421, 'faq_section_faq_list_9_content', '<p>Right now you can copy the template and send them out, our system doesn\'t work as a CRM. It was built as a content platform.</p>'),
(25145, 421, '_faq_section_faq_list_9_content', 'field_63c93ec3086f2'),
(25146, 421, 'faq_section_faq_list_10_title', 'What type of content do you create?'),
(25147, 421, '_faq_section_faq_list_10_title', 'field_63c93eb9086f1'),
(25148, 421, 'faq_section_faq_list_10_content', '<p>Our content is focused on real estate.The topics range from investing, first-time home ownership, how to refinance your mortgage, to even more relatable quotes, and funny memes.</p>'),
(25149, 421, '_faq_section_faq_list_10_content', 'field_63c93ec3086f2'),
(25150, 421, 'faq_section_faq_list_11_title', 'Why are your prices so low?'),
(25151, 421, '_faq_section_faq_list_11_title', 'field_63c93eb9086f1'),
(25152, 421, 'faq_section_faq_list_11_content', '<p>We recognize that marketing can get pricey, and we want to make it affordable to everyone. And because we put technology first behind our product it allows us to bring costs down.</p>'),
(25153, 421, '_faq_section_faq_list_11_content', 'field_63c93ec3086f2'),
(25154, 421, 'faq_section_faq_list_12_title', 'Is the content always accessible?'),
(25155, 421, '_faq_section_faq_list_12_title', 'field_63c93eb9086f1'),
(25156, 421, 'faq_section_faq_list_12_content', '<p>Yes, the content rolls over so you\'ll have access to last month\'s posts.</p>'),
(25157, 421, '_faq_section_faq_list_12_content', 'field_63c93ec3086f2'),
(25158, 421, 'faq_section_faq_list_13_title', 'Does everyone get access to the same content?'),
(25159, 421, '_faq_section_faq_list_13_title', 'field_63c93eb9086f1'),
(25160, 421, 'faq_section_faq_list_13_content', '<p>Yes, but everyone\'s digital audience is unique. It\'s a very low risk that you would post something and then someone else on your team posts the same thing because you have access to a whole library of posts.</p>'),
(25161, 421, '_faq_section_faq_list_13_content', 'field_63c93ec3086f2'),
(25162, 421, 'faq_section_faq_list_14_title', 'Can I add my headshot or logo to the posts?'),
(25163, 421, '_faq_section_faq_list_14_title', 'field_63c93eb9086f1'),
(25164, 421, 'faq_section_faq_list_14_content', '<p>Yes, in your profile in the dashboardyou can upload an image that will be featured on every post.</p>'),
(25165, 421, '_faq_section_faq_list_14_content', 'field_63c93ec3086f2'),
(25166, 421, 'faq_section_faq_list_15_title', 'Who are some of your clients?'),
(25167, 421, '_faq_section_faq_list_15_title', 'field_63c93eb9086f1'),
(25168, 421, 'faq_section_faq_list_15_content', '<p>We have customers all over the US. From Keller Williams, and Coldwell Banker, to Florida\'s First Choice Realty, and a lot of other brokerages.</p>'),
(25169, 421, '_faq_section_faq_list_15_content', 'field_63c93ec3086f2'),
(25170, 421, 'faq_section_faq_list_16_title', 'How do I make sure this is in line with my branding/broker branding?'),
(25171, 421, '_faq_section_faq_list_16_title', 'field_63c93eb9086f1'),
(25172, 421, 'faq_section_faq_list_16_content', '<p>We offer assets in a variety of colors to ensure that your social feed stays consistent to your established branding. If you don’t see the content aligns, reach out to our team.</p>'),
(25173, 421, '_faq_section_faq_list_16_content', 'field_63c93ec3086f2'),
(25174, 421, 'faq_section_faq_list_17_title', 'How often is new content uploaded?'),
(25175, 421, '_faq_section_faq_list_17_title', 'field_63c93eb9086f1'),
(25176, 421, 'faq_section_faq_list_17_content', '<p>Every month we have new content drops. The blogs and emails are on a continual basis.</p>'),
(25177, 421, '_faq_section_faq_list_17_content', 'field_63c93ec3086f2'),
(25178, 421, 'faq_section_faq_list_18_title', 'Do you offer this in Spanish?'),
(25179, 421, '_faq_section_faq_list_18_title', 'field_63c93eb9086f1'),
(25180, 421, 'faq_section_faq_list_18_content', '<p>Yes, starting February 2023 we will have this available.</p>'),
(25181, 421, '_faq_section_faq_list_18_content', 'field_63c93ec3086f2'),
(25182, 421, 'faq_section_faq_list_19_title', 'If I\'m a new real estate agent, is this for me?'),
(25183, 421, '_faq_section_faq_list_19_title', 'field_63c93eb9086f1'),
(25184, 421, 'faq_section_faq_list_19_content', '<p>For new real estate agents, this is perfect, because they can still post valuable content and build a niche following until they get a listing to post about.</p>'),
(25185, 421, '_faq_section_faq_list_19_content', 'field_63c93ec3086f2'),
