(26219, 432, 'next_level_section_hiring_a_social_media_expert', '<table>\r\n<tbody>\r\n<tr>\r\n<th>Hiring a Social Media Expert</th>\r\n<th><img class=\"alignnone size-full wp-image-15\" src=\"http://localhost/zenzio/wp-content/uploads/2023/01/logo.svg\" alt=\"Zenzio\" width=\"227\" height=\"66\" /></th>\r\n</tr>\r\n<tr>\r\n<td>Monthly meetings to review and send them new content ideas</td>\r\n<td>Monthly meetings to review and send them new content ideas</td>\r\n</tr>\r\n<tr>\r\n<td>They create not educate you on best practices or trends</td>\r\n<td>Our marketing experts host strategy calls and send newsletters on content tips and trends</td>\r\n</tr>\r\n<tr>\r\n<td>Learning curve for your designer to understand the real estate industry</td>\r\n<td>Members of our team are active agents and well versed in finance and the mortgage industry</td>\r\n</tr>\r\n<tr>\r\n<td>You need a scheduling platform</td>\r\n<td>Schedule your posts with Zenzio to LinkedIn, Facebook, Instagram, and TikTok. Or join our Managed Plan to have our team handle it.</td>\r\n</tr>\r\n<tr>\r\n<td>$500 - $1,200 a month</td>\r\n<td>Self-service for $47/mo. Social media management for $98/mo.</td>\r\n</tr>\r\n</tbody>\r\n</table>'),
(26220, 432, '_next_level_section_hiring_a_social_media_expert', 'field_63c8085567301'),
(26221, 432, 'next_level_section_zenzio', ''),
(26222, 432, '_next_level_section_zenzio', 'field_63c8092f67302'),
(26223, 432, 'next_level_section', ''),
(26224, 432, '_next_level_section', 'field_63c8081a672ff'),
(26225, 432, 'realtor_section_top_section', '<h2>Zenzio is so Simple a Realtor Trying to Juggle Content <br>Marketing and Full-Time Realty Can do it</h2>\r\n<p>It\'s as easy as 1, 2, 3 - literally. 3 steps is all it takes to free yourself from content marketing <br>forever. And focus on what you do best - Help your clients find homes.</p>'),
(26226, 432, '_realtor_section_top_section', 'field_63c8ddc7b491e'),
(26227, 432, 'realtor_section_realtor_content_0_number', '1'),
(26228, 432, '_realtor_section_realtor_content_0_number', 'field_63c8de41b4920'),
(26229, 432, 'realtor_section_realtor_content_0_icon', '123'),
(26230, 432, '_realtor_section_realtor_content_0_icon', 'field_63c8de54b4921'),
(26231, 432, 'realtor_section_realtor_content_0_title', 'Explore Membership & Seal the Deal'),
(26232, 432, '_realtor_section_realtor_content_0_title', 'field_63c8de65b4922'),
(26233, 432, 'realtor_section_realtor_content_0_content', '<p>You\'ll receive an onboarding email with a personalized video that explains the dashboard and its features.</p>'),
(26234, 432, '_realtor_section_realtor_content_0_content', 'field_63c8de6db4923'),
(26235, 432, 'realtor_section_realtor_content_1_number', '2'),
(26236, 432, '_realtor_section_realtor_content_1_number', 'field_63c8de41b4920'),
