(26238, 432, '_realtor_section_realtor_content_1_icon', 'field_63c8de54b4921'),
(26239, 432, 'realtor_section_realtor_content_1_title', 'Gain Instant Access to your Social Media Content Dreams'),
(26240, 432, '_realtor_section_realtor_content_1_title', 'field_63c8de65b4922'),
(26241, 432, 'realtor_section_realtor_content_1_content', '<p>The content library, email starters, blogs, and listing description generator are all ready for you to use.</p>'),
(26242, 432, '_realtor_section_realtor_content_1_content', 'field_63c8de6db4923'),
(26243, 432, 'realtor_section_realtor_content_2_number', '3'),
(26244, 432, '_realtor_section_realtor_content_2_number', 'field_63c8de41b4920'),
