(26543, 433, 'about_content', '<h2>STOP Spending Hours on Canva Templates, FB posts, Emails, and Blogs - Zenzio Does it All For You</h2>\r\nIf you’re tired of spending hours on <strong>Canva templates</strong>\r\n\r\nIf you’re sick of coming up with ideas for every single <strong>Facebook post</strong>\r\n\r\nIf you’re exhausted trying to learn expensive <strong>Google ads</strong> Stop\r\n\r\nZenzio handles everything for you, with just a click of a mouse <strong>Sounds crazy?</strong>\r\n<h3>That’s because it is. Crazy awesome</h3>'),
