(26576, 433, '_testimonials_0_designation', 'field_63c7e818eb433'),
(26577, 433, 'testimonials_0_author', '407'),
(26578, 433, '_testimonials_0_author', 'field_63c7e81feb434'),
(26579, 433, 'testimonials_1_title', 'I didn\'t know how I did it before Zenzio'),
(26580, 433, '_testimonials_1_title', 'field_63c7e7d1eb42f'),
(26581, 433, 'testimonials_1_star', '72'),
(26582, 433, '_testimonials_1_star', 'field_63c7e7daeb430'),
(26583, 433, 'testimonials_1_content', '<p>Zenzio has allowed me to continue focusing on sales and closings while my social media is on autopilot. It helps build my brand and leads for my real estate business.</p>'),
(26584, 433, '_testimonials_1_content', 'field_63c7e7efeb431'),
(26585, 433, 'testimonials_1_name', 'Daniel G.'),
(26586, 433, '_testimonials_1_name', 'field_63c7e7fdeb432'),
