(26588, 433, '_testimonials_1_designation', 'field_63c7e818eb433'),
(26589, 433, 'testimonials_1_author', '405'),
(26590, 433, '_testimonials_1_author', 'field_63c7e81feb434'),
(26591, 433, 'testimonials_2_title', 'Easy to use'),
(26592, 433, '_testimonials_2_title', 'field_63c7e7d1eb42f'),
(26593, 433, 'testimonials_2_star', '72'),
(26594, 433, '_testimonials_2_star', 'field_63c7e7daeb430'),
(26595, 433, 'testimonials_2_content', '<p>I love how easy Zenzio makes it to create great content and share it with my audience. The best part is that I am not stuck creating more content than I have time for.</p>'),
(26596, 433, '_testimonials_2_content', 'field_63c7e7efeb431'),
(26597, 433, 'testimonials_2_name', 'Jennifer S.'),
(26598, 433, '_testimonials_2_name', 'field_63c7e7fdeb432'),
