(26605, 433, 'success_section_image', '399'),
(26606, 433, '_success_section_image', 'field_63c7fd803e6f6'),
(26607, 433, 'success_section_content', '<h2>If You’re Not Getting the Likes and Comments You Want - It’s Not Your Fault</h2>\r\nThe truth is, content marketing is a profession all on it’s own.\r\n<ul>\r\n 	<li>You can’t expect to get the results marketing professionals get</li>\r\n 	<li>You’re competing against professional marketers who know the algorithms</li>\r\n 	<li>They’ve been studying, practicing, and “doing” for years and years. And that’s their specialty.</li>\r\n</ul>'),
(26608, 433, '_success_section_content', 'field_63c7fd923e6f8'),
(26609, 433, 'success_section', ''),
(26610, 433, '_success_section', 'field_63c7fd053e6f5'),
(26611, 433, 'now_never_section_image', '400'),
(26612, 433, '_now_never_section_image', 'field_63c80217a675f'),
(26613, 433, 'now_never_section_content', '<h2>Now? Or Never? It’s up to You!</h2>\r\nWith our busy lives, we can forget even the most important things.\r\n\r\nHow many times have you taken a screenshot, made a bookmark, or saved a video? Only for it to be forgotten, lost in a pile of “will check out later” things\r\n\r\nWe don’t want you to forget us, so we want to offer you a no-brainer deal: Sign up today, at no risk - you’ll know within 5 minutes if Zenzio is for you.'),
(26614, 433, '_now_never_section_content', 'field_63c80217a6760'),
(26615, 433, 'now_never_section', ''),
(26616, 433, '_now_never_section', 'field_63c80217a675e'),
(26617, 433, 'content_creation_image', '401'),
(26618, 433, '_content_creation_image', 'field_63c80532fc142'),
(26619, 433, 'content_creation_content', '<h2>We’ve Been Freeing Realtors From Content Creation</h2>\r\nI can still remember the turning point in my career. One night I had probably spent close to 2 hours customizing a canva template, filling in all the content, looking up youtube videos on how to make it better, and making it PERFECT. I remember naively thinking to myself “this could go viral.\r\n\r\nI posted it close to 12AM, then crawled in bed Waking up the next morning, my eyes were barely open as I excitedly typed in the password to my phone and opened the Facebook app to check on how the post did.\r\n<h4>5 likes. 1 comment. From my mother...</h4>'),
(26620, 433, '_content_creation_content', 'field_63c80532fc143'),
(26621, 433, 'content_creation', ''),
(26622, 433, '_content_creation', 'field_63c80532fc141'),
(26623, 433, 'next_level_section_title', 'Take Your Content to the Next Level'),
(26624, 433, '_next_level_section_title', 'field_63c8084d67300'),
(26625, 433, 'next_level_section_hiring_a_social_media_expert', '<table>\r\n<tbody>\r\n<tr>\r\n<th>Hiring a Social Media Expert</th>\r\n<th><img class=\"alignnone size-full wp-image-15\" src=\"http://localhost/zenzio/wp-content/uploads/2023/01/logo.svg\" alt=\"Zenzio\" width=\"227\" height=\"66\" /></th>\r\n</tr>\r\n<tr>\r\n<td>Monthly meetings to review and send them new content ideas</td>\r\n<td>Monthly meetings to review and send them new content ideas</td>\r\n</tr>\r\n<tr>\r\n<td>They create not educate you on best practices or trends</td>\r\n<td>Our marketing experts host strategy calls and send newsletters on content tips and trends</td>\r\n</tr>\r\n<tr>\r\n<td>Learning curve for your designer to understand the real estate industry</td>\r\n<td>Members of our team are active agents and well versed in finance and the mortgage industry</td>\r\n</tr>\r\n<tr>\r\n<td>You need a scheduling platform</td>\r\n<td>Schedule your posts with Zenzio to LinkedIn, Facebook, Instagram, and TikTok. Or join our Managed Plan to have our team handle it.</td>\r\n</tr>\r\n<tr>\r\n<td>$500 - $1,200 a month</td>\r\n<td>Self-service for $47/mo. Social media management for $98/mo.</td>\r\n</tr>\r\n</tbody>\r\n</table>'),
(26626, 433, '_next_level_section_hiring_a_social_media_expert', 'field_63c8085567301'),
(26627, 433, 'next_level_section_zenzio', ''),
(26628, 433, '_next_level_section_zenzio', 'field_63c8092f67302'),
(26629, 433, 'next_level_section', ''),
(26630, 433, '_next_level_section', 'field_63c8081a672ff'),
(26631, 433, 'realtor_section_top_section', '<h2>Zenzio is so Simple a Realtor Trying to Juggle Content <br>Marketing and Full-Time Realty Can do it</h2>\r\n<p>It\'s as easy as 1, 2, 3 - literally. 3 steps is all it takes to free yourself from content marketing <br>forever. And focus on what you do best - Help your clients find homes.</p>'),
(26632, 433, '_realtor_section_top_section', 'field_63c8ddc7b491e'),
(26633, 433, 'realtor_section_realtor_content_0_number', '1'),
(26634, 433, '_realtor_section_realtor_content_0_number', 'field_63c8de41b4920'),
(26635, 433, 'realtor_section_realtor_content_0_icon', '123'),
(26636, 433, '_realtor_section_realtor_content_0_icon', 'field_63c8de54b4921'),
(26637, 433, 'realtor_section_realtor_content_0_title', 'Explore Membership & Seal the Deal'),
(26638, 433, '_realtor_section_realtor_content_0_title', 'field_63c8de65b4922'),
(26639, 433, 'realtor_section_realtor_content_0_content', '<p>You\'ll receive an onboarding email with a personalized video that explains the dashboard and its features.</p>'),
(26640, 433, '_realtor_section_realtor_content_0_content', 'field_63c8de6db4923'),
(26641, 433, 'realtor_section_realtor_content_1_number', '2'),
