(26984, 434, '_testimonials_0_author', 'field_63c7e81feb434'),
(26985, 434, 'testimonials_1_title', 'I didn\'t know how I did it before Zenzio'),
(26986, 434, '_testimonials_1_title', 'field_63c7e7d1eb42f'),
(26987, 434, 'testimonials_1_star', '72'),
(26988, 434, '_testimonials_1_star', 'field_63c7e7daeb430'),
(26989, 434, 'testimonials_1_content', '<p>Zenzio has allowed me to continue focusing on sales and closings while my social media is on autopilot. It helps build my brand and leads for my real estate business.</p>'),
