(26996, 434, '_testimonials_1_author', 'field_63c7e81feb434'),
(26997, 434, 'testimonials_2_title', 'Easy to use'),
(26998, 434, '_testimonials_2_title', 'field_63c7e7d1eb42f'),
(26999, 434, 'testimonials_2_star', '72'),
(27000, 434, '_testimonials_2_star', 'field_63c7e7daeb430'),
(27001, 434, 'testimonials_2_content', '<p>I love how easy Zenzio makes it to create great content and share it with my audience. The best part is that I am not stuck creating more content than I have time for.</p>'),
(27002, 434, '_testimonials_2_content', 'field_63c7e7efeb431'),
