(27031, 434, 'next_level_section_hiring_a_social_media_expert', '<table>\r\n<tbody>\r\n<tr>\r\n<th>Hiring a Social Media Expert</th>\r\n<th><img class=\"alignnone size-full wp-image-15\" src=\"http://localhost/zenzio/wp-content/uploads/2023/01/logo.svg\" alt=\"Zenzio\" width=\"227\" height=\"66\" /></th>\r\n</tr>\r\n<tr>\r\n<td>Monthly meetings to review and send them new content ideas</td>\r\n<td>Monthly meetings to review and send them new content ideas</td>\r\n</tr>\r\n<tr>\r\n<td>They create not educate you on best practices or trends</td>\r\n<td>Our marketing experts host strategy calls and send newsletters on content tips and trends</td>\r\n</tr>\r\n<tr>\r\n<td>Learning curve for your designer to understand the real estate industry</td>\r\n<td>Members of our team are active agents and well versed in finance and the mortgage industry</td>\r\n</tr>\r\n<tr>\r\n<td>You need a scheduling platform</td>\r\n<td>Schedule your posts with Zenzio to LinkedIn, Facebook, Instagram, and TikTok. Or join our Managed Plan to have our team handle it.</td>\r\n</tr>\r\n<tr>\r\n<td>$500 - $1,200 a month</td>\r\n<td>Self-service for $47/mo. Social media management for $98/mo.</td>\r\n</tr>\r\n</tbody>\r\n</table>'),
(27032, 434, '_next_level_section_hiring_a_social_media_expert', 'field_63c8085567301'),
(27033, 434, 'next_level_section_zenzio', ''),
(27034, 434, '_next_level_section_zenzio', 'field_63c8092f67302'),
(27035, 434, 'next_level_section', ''),
(27036, 434, '_next_level_section', 'field_63c8081a672ff'),
(27037, 434, 'realtor_section_top_section', '<h2>Zenzio is so Simple a Realtor Trying to Juggle Content <br>Marketing and Full-Time Realty Can do it</h2>\r\n<p>It\'s as easy as 1, 2, 3 - literally. 3 steps is all it takes to free yourself from content marketing <br>forever. And focus on what you do best - Help your clients find homes.</p>'),
(27038, 434, '_realtor_section_top_section', 'field_63c8ddc7b491e'),
(27039, 434, 'realtor_section_realtor_content_0_number', '1'),
(27040, 434, '_realtor_section_realtor_content_0_number', 'field_63c8de41b4920'),
(27041, 434, 'realtor_section_realtor_content_0_icon', '123'),
(27042, 434, '_realtor_section_realtor_content_0_icon', 'field_63c8de54b4921'),
(27043, 434, 'realtor_section_realtor_content_0_title', 'Explore Membership & Seal the Deal'),
(27044, 434, '_realtor_section_realtor_content_0_title', 'field_63c8de65b4922'),
(27045, 434, 'realtor_section_realtor_content_0_content', '<p>You\'ll receive an onboarding email with a personalized video that explains the dashboard and its features.</p>'),
(27046, 434, '_realtor_section_realtor_content_0_content', 'field_63c8de6db4923'),
(27047, 434, 'realtor_section_realtor_content_1_number', '2'),
(27048, 434, '_realtor_section_realtor_content_1_number', 'field_63c8de41b4920'),
(27049, 434, 'realtor_section_realtor_content_1_icon', '122'),
(27050, 434, '_realtor_section_realtor_content_1_icon', 'field_63c8de54b4921'),
(27051, 434, 'realtor_section_realtor_content_1_title', 'Gain Instant Access to your Social Media Content Dreams'),
(27052, 434, '_realtor_section_realtor_content_1_title', 'field_63c8de65b4922'),
(27053, 434, 'realtor_section_realtor_content_1_content', '<p>The content library, email starters, blogs, and listing description generator are all ready for you to use.</p>'),
(27054, 434, '_realtor_section_realtor_content_1_content', 'field_63c8de6db4923'),
(27055, 434, 'realtor_section_realtor_content_2_number', '3'),
(27056, 434, '_realtor_section_realtor_content_2_number', 'field_63c8de41b4920'),
(27057, 434, 'realtor_section_realtor_content_2_icon', '121'),
(27058, 434, '_realtor_section_realtor_content_2_icon', 'field_63c8de54b4921'),
(27059, 434, 'realtor_section_realtor_content_2_title', 'Start Kiltling It Online'),
(27060, 434, '_realtor_section_realtor_content_2_title', 'field_63c8de65b4922'),
(27061, 434, 'realtor_section_realtor_content_2_content', '<p>Schedule your engaging posts, personalize them with your branding, and start generating leads!</p>'),
(27062, 434, '_realtor_section_realtor_content_2_content', 'field_63c8de6db4923'),
(27063, 434, 'realtor_section_realtor_content', '3'),
(27064, 434, '_realtor_section_realtor_content', 'field_63c8ddf6b491f'),
(27065, 434, 'realtor_section', ''),
(27066, 434, '_realtor_section', 'field_63c8dd7db491d'),
(27067, 434, 'realtor_section_bottom_section', 'See how effortless your social media journey will become\r\n\r\n<a class=\"btn btnBig\" href=\"#videoSection\">watch now</a>'),
(27068, 434, '_realtor_section_bottom_section', 'field_63c8e2368ccb2'),
(27069, 434, 'success_section_bottom_content', 'You’re a realtor trying to balance content marketing AND real estate. You just can’t compete, and that’s not your fault.\r\n\r\nThat’s why Zenzio does it for you, without you having to hire an expensive marketing consultancy.\r\n\r\nOur marketing professionals do what an agency would do, at a fraction of the cost. So you can get powerful unique content at the click of a button, without selling your kidney.'),
(27070, 434, '_success_section_bottom_content', 'field_63c90ecbf7adf'),
(27071, 434, 'now_never_section_left_content', '<p>If you find Zenzio isn’t for you, you can cancel anytime with a <span>14-day 100% money-back guarantee</span> - no hassle, no questions asked</p>\r\n<ul>\r\n<li><span>Step 1.</span> Click cancel subscription</li>\r\n<li><span>Step 2.</span> Get your 100% refund</li>\r\n<li><span>Step 3.</span> (There is no step 3)</li>\r\n</ul>\r\n<a href=\"#\" class=\"btn\">Sign Up Now</a>'),
(27072, 434, '_now_never_section_left_content', 'field_63c90fda991ca'),
(27073, 434, 'content_creation_right_content', ''),
(27074, 434, '_content_creation_right_content', 'field_63c910083bbbd'),
(27075, 434, 'now_never_section_bottom_left_content', '<p>If you find Zenzio isn’t for you, you can cancel anytime with a <span>14-day 100% money-back guarantee</span> - no hassle, no questions asked</p>\r\n<ul>\r\n<li><span>Step 1.</span> Click cancel subscription</li>\r\n<li><span>Step 2.</span> Get your 100% refund</li>\r\n<li><span>Step 3.</span> (There is no step 3)</li>\r\n</ul>\r\n<a href=\"#getStartSection\" class=\"btn btnBig\">Sign Up Now</a>'),
(27076, 434, '_now_never_section_bottom_left_content', 'field_63c911b037a55'),
(27077, 434, 'now_never_section_bottom_right_content', '<h3>We want you to be as confident as we are that Zenzio will:</h3>\r\n<ul>\r\n 	<li>Remove the frustrations of content marketing from your life</li>\r\n 	<li>Free you up to spend more time with family and friends</li>\r\n 	<li>Give you more time to focus on what you do best - help your clients find homes!</li>\r\n</ul>'),
(27078, 434, '_now_never_section_bottom_right_content', 'field_63c911bf37a56'),
(27079, 434, 'content_creation_bottom_content', 'That was the last soul-crushing straw. I promised myself I was done wasting time on trying to do my own social media posts, or any marketing for that matter.\r\n\r\nI wasn’t just wasting my time on disappointing results, but I was getting close to zero time with my kids I switched from looking up “How to create powerful Facebook posts” to “Marketing agency near me” I realized very quickly that I didn’t want to pay an arm and a leg for a marketing agency.\r\n\r\nAnd just as I was about to go back to my disappointing world of hoping and trying to create content myself - I found Zenzio.\r\n\r\nAnd I haven’t looked back. 5 years later, I really can’t imagine what my life would look like if I was still spending god knows how many hours trying to make my own content.\r\n\r\nI never realized just how much time I wasted until it was given back to me, and I can honestly say Zenzio has given me back time I can spend with my kids, and a hyper focus on helping my clients.'),
(27080, 434, '_content_creation_bottom_content', 'field_63c910083bbbd'),
(27081, 434, 'realtor_section_realtor_steps', '<h3>That\'s it!</h3>\r\n<ul>\r\n 	<li>1 steps to save you thousands of hours creating content</li>\r\n 	<li>2 steps to save you from competing with marketing experts</li>\r\n 	<li>3 steps to get you more time with family, and less time being frustrated</li>\r\n</ul>'),
(27082, 434, '_realtor_section_realtor_steps', 'field_63c9230cc1c7e'),
(27083, 434, 'money_back_money_back_image', '171'),
(27084, 434, '_money_back_money_back_image', 'field_63c93016e2e22'),
