(27125, 434, 'our_client', ''),
(27126, 434, '_our_client', 'field_63c93256e94c9'),
(27127, 434, 'your_sanity_section_top_section', '<h2>Sometimes All You Have to Lose is Your Sanity</h2>\r\nYou don\'t need to drive yourself crazy trying to learn and create content. But, we\'re not\r\ngoing to tell you how to live your life.\r\n\r\n<em>We\'re not going to say you need Zenzio, but what we will tell you is this:</em>'),
(27128, 434, '_your_sanity_section_top_section', 'field_63c938a63de24'),
(27129, 434, 'your_sanity_section_left_section', '<h3>You have a choice to make</h3>\r\n<ul>\r\n 	<li>You can do nothing, and nothing will change</li>\r\n 	<li>You can continue to do it yourself, and maybe something will change</li>\r\n 	<li>Or you can try Zenzio today, risk free, and everything will change</li>\r\n</ul>\r\n<a class=\"btn btnBig\" href=\"#getStartSection\">Sign Up Now</a>'),
(27130, 434, '_your_sanity_section_left_section', 'field_63c938dd3de25'),
(27131, 434, 'your_sanity_section_right_section', 'It\'s all up to you, and whatever you choose, we\'ll be rooting for you!\r\n\r\nIf you\'re ready, click the “Sign up” button below to check Zenzio out risk-free. Remember, if you find Zenzio isn\'t for you, you can cancel anytime.\r\n\r\nWith a 100% money-back NO HASSLE guarantee, for 14 days <span class=\"italic\">(You\'ll know within 5 minutes or less if Zenzio is for you)</span>'),
(27132, 434, '_your_sanity_section_right_section', 'field_63c938eb3de26'),
(27133, 434, 'your_sanity_section', ''),
(27134, 434, '_your_sanity_section', 'field_63c938733de23'),
(27135, 434, 'faq_section_title', 'Have Questions? You\'re in the Right Place'),
(27136, 434, '_faq_section_title', 'field_63c93e90086ef'),
(27137, 434, 'faq_section_faq_list_0_title', 'How do your services work?'),
(27138, 434, '_faq_section_faq_list_0_title', 'field_63c93eb9086f1'),
(27139, 434, 'faq_section_faq_list_0_content', '<p>You get full access to a personalized marketing content platform. Each month get access to new social content all done for you (the graphics, captions, and hashtags).You sync your accounts to start posting and scheduling content. Or with our managed plan, our team will manage your social media by using our content.</p>'),
(27140, 434, '_faq_section_faq_list_0_content', 'field_63c93ec3086f2'),
(27141, 434, 'faq_section_faq_list_1_title', 'How do your packages work?'),
(27142, 434, '_faq_section_faq_list_1_title', 'field_63c93eb9086f1'),
(27143, 434, 'faq_section_faq_list_1_content', '<p>You can subscribe on a monthly basis or join with an annual subscription for the self-service and managed plan.</p>'),
(27144, 434, '_faq_section_faq_list_1_content', 'field_63c93ec3086f2'),
(27145, 434, 'faq_section_faq_list_2_title', 'Can I schedule my posts in advance?'),
(27146, 434, '_faq_section_faq_list_2_title', 'field_63c93eb9086f1'),
(27147, 434, 'faq_section_faq_list_2_content', '<p>Yes, we have a scheduling feature available in the platform where you can set the time and day for each individual post to go out. You\'ll have visibility on scheduled posts that are pending for the upcoming week or month.</p>'),
(27148, 434, '_faq_section_faq_list_2_content', 'field_63c93ec3086f2'),
(27149, 434, 'faq_section_faq_list_3_title', 'Can I edit my captions and hashtags?'),
(27150, 434, '_faq_section_faq_list_3_title', 'field_63c93eb9086f1'),
(27151, 434, 'faq_section_faq_list_3_content', '<p>Yes, you can always make changes to the pre-written captions and hashtags. You can copy it in the dashboard and then paste it into a notepad or respective social media platform, and make the manual changes. <em>(The dashboard doesn\'t currently support text changes in the platform at this time, but we are working on this in the coming months.)</em></p>'),
(27152, 434, '_faq_section_faq_list_3_content', 'field_63c93ec3086f2'),
(27153, 434, 'faq_section_faq_list_4_title', 'Which social media platform does the platform allow me to post to?'),
(27154, 434, '_faq_section_faq_list_4_title', 'field_63c93eb9086f1'),
(27155, 434, 'faq_section_faq_list_4_content', '<p>You can sync up the following accounts: Instagram Business, Facebook Business, and LinkedIn. In the near future Twitter and TikTok.</p>'),
(27156, 434, '_faq_section_faq_list_4_content', 'field_63c93ec3086f2'),
(27157, 434, 'faq_section_faq_list_5_title', 'What are hashtags for?'),
(27158, 434, '_faq_section_faq_list_5_title', 'field_63c93eb9086f1'),
(27159, 434, 'faq_section_faq_list_5_content', '<p>Hashtags help your posts gain visibility as people search for your keywords and related keywords on social media. It helps feed the algorithm but also helps you attract a more niche audience to your posts and profile by attracting</p>'),
(27160, 434, '_faq_section_faq_list_5_content', 'field_63c93ec3086f2'),
(27161, 434, 'faq_section_faq_list_6_title', 'So do I still have to write my captions?'),
(27162, 434, '_faq_section_faq_list_6_title', 'field_63c93eb9086f1'),
(27163, 434, 'faq_section_faq_list_6_content', '<p>Nope, we have the captions and hashtags written for you.</p>'),
(27164, 434, '_faq_section_faq_list_6_content', 'field_63c93ec3086f2'),
(27165, 434, 'faq_section_faq_list_7_title', 'Do I still have to log in and schedule the posts or does someone on the Zenzio team post for me?'),
(27166, 434, '_faq_section_faq_list_7_title', 'field_63c93eb9086f1'),
(27167, 434, 'faq_section_faq_list_7_content', '<p>Depends on the plan you choose, but we can arrange to manage your social media.</p>'),
(27168, 434, '_faq_section_faq_list_7_content', 'field_63c93ec3086f2'),
(27169, 434, 'faq_section_faq_list_8_title', 'Can I customize the posts?'),
(27170, 434, '_faq_section_faq_list_8_title', 'field_63c93eb9086f1'),
(27171, 434, 'faq_section_faq_list_8_content', '<p>At this time, our posts are pre-designed for a more hands off approach. You can customize it by adding in your branding: brokerage logo or headshot. We are always open to feedback on content style.</p>'),
(27172, 434, '_faq_section_faq_list_8_content', 'field_63c93ec3086f2'),
(27173, 434, 'faq_section_faq_list_9_title', 'Do you connect with my CRM for email campaigns? Can you launch the emails from the dashboard?'),
(27174, 434, '_faq_section_faq_list_9_title', 'field_63c93eb9086f1'),
(27175, 434, 'faq_section_faq_list_9_content', '<p>Right now you can copy the template and send them out, our system doesn\'t work as a CRM. It was built as a content platform.</p>'),
(27176, 434, '_faq_section_faq_list_9_content', 'field_63c93ec3086f2'),
(27177, 434, 'faq_section_faq_list_10_title', 'What type of content do you create?'),
(27178, 434, '_faq_section_faq_list_10_title', 'field_63c93eb9086f1'),
(27179, 434, 'faq_section_faq_list_10_content', '<p>Our content is focused on real estate.The topics range from investing, first-time home ownership, how to refinance your mortgage, to even more relatable quotes, and funny memes.</p>'),
(27180, 434, '_faq_section_faq_list_10_content', 'field_63c93ec3086f2'),
(27181, 434, 'faq_section_faq_list_11_title', 'Why are your prices so low?'),
(27182, 434, '_faq_section_faq_list_11_title', 'field_63c93eb9086f1'),
(27183, 434, 'faq_section_faq_list_11_content', '<p>We recognize that marketing can get pricey, and we want to make it affordable to everyone. And because we put technology first behind our product it allows us to bring costs down.</p>'),
(27184, 434, '_faq_section_faq_list_11_content', 'field_63c93ec3086f2'),
(27185, 434, 'faq_section_faq_list_12_title', 'Is the content always accessible?'),
(27186, 434, '_faq_section_faq_list_12_title', 'field_63c93eb9086f1'),
(27187, 434, 'faq_section_faq_list_12_content', '<p>Yes, the content rolls over so you\'ll have access to last month\'s posts.</p>'),
(27188, 434, '_faq_section_faq_list_12_content', 'field_63c93ec3086f2'),
(27189, 434, 'faq_section_faq_list_13_title', 'Does everyone get access to the same content?'),
(27190, 434, '_faq_section_faq_list_13_title', 'field_63c93eb9086f1'),
(27191, 434, 'faq_section_faq_list_13_content', '<p>Yes, but everyone\'s digital audience is unique. It\'s a very low risk that you would post something and then someone else on your team posts the same thing because you have access to a whole library of posts.</p>'),
(27192, 434, '_faq_section_faq_list_13_content', 'field_63c93ec3086f2'),
(27193, 434, 'faq_section_faq_list_14_title', 'Can I add my headshot or logo to the posts?'),
(27194, 434, '_faq_section_faq_list_14_title', 'field_63c93eb9086f1'),
(27195, 434, 'faq_section_faq_list_14_content', '<p>Yes, in your profile in the dashboardyou can upload an image that will be featured on every post.</p>'),
(27196, 434, '_faq_section_faq_list_14_content', 'field_63c93ec3086f2'),
(27197, 434, 'faq_section_faq_list_15_title', 'Who are some of your clients?'),
(27198, 434, '_faq_section_faq_list_15_title', 'field_63c93eb9086f1'),
(27199, 434, 'faq_section_faq_list_15_content', '<p>We have customers all over the US. From Keller Williams, and Coldwell Banker, to Florida\'s First Choice Realty, and a lot of other brokerages.</p>'),
(27200, 434, '_faq_section_faq_list_15_content', 'field_63c93ec3086f2'),
(27201, 434, 'faq_section_faq_list_16_title', 'How do I make sure this is in line with my branding/broker branding?'),
(27202, 434, '_faq_section_faq_list_16_title', 'field_63c93eb9086f1'),
(27203, 434, 'faq_section_faq_list_16_content', '<p>We offer assets in a variety of colors to ensure that your social feed stays consistent to your established branding. If you don’t see the content aligns, reach out to our team.</p>'),
(27204, 434, '_faq_section_faq_list_16_content', 'field_63c93ec3086f2'),
(27205, 434, 'faq_section_faq_list_17_title', 'How often is new content uploaded?'),
(27206, 434, '_faq_section_faq_list_17_title', 'field_63c93eb9086f1'),
(27207, 434, 'faq_section_faq_list_17_content', '<p>Every month we have new content drops. The blogs and emails are on a continual basis.</p>'),
(27208, 434, '_faq_section_faq_list_17_content', 'field_63c93ec3086f2'),
(27209, 434, 'faq_section_faq_list_18_title', 'Do you offer this in Spanish?'),
(27210, 434, '_faq_section_faq_list_18_title', 'field_63c93eb9086f1'),
(27211, 434, 'faq_section_faq_list_18_content', '<p>Yes, starting February 2023 we will have this available.</p>'),
(27212, 434, '_faq_section_faq_list_18_content', 'field_63c93ec3086f2'),
(27213, 434, 'faq_section_faq_list_19_title', 'If I\'m a new real estate agent, is this for me?'),
(27214, 434, '_faq_section_faq_list_19_title', 'field_63c93eb9086f1'),
(27215, 434, 'faq_section_faq_list_19_content', '<p>For new real estate agents, this is perfect, because they can still post valuable content and build a niche following until they get a listing to post about.</p>'),
