(27390, 435, '_testimonials_0_author', 'field_63c7e81feb434'),
(27391, 435, 'testimonials_1_title', 'I didn\'t know how I did it before Zenzio'),
(27392, 435, '_testimonials_1_title', 'field_63c7e7d1eb42f'),
(27393, 435, 'testimonials_1_star', '72'),
(27394, 435, '_testimonials_1_star', 'field_63c7e7daeb430'),
(27395, 435, 'testimonials_1_content', '<p>Zenzio has allowed me to continue focusing on sales and closings while my social media is on autopilot. It helps build my brand and leads for my real estate business.</p>'),
