(27404, 435, '_testimonials_2_title', 'field_63c7e7d1eb42f'),
(27405, 435, 'testimonials_2_star', '72'),
(27406, 435, '_testimonials_2_star', 'field_63c7e7daeb430'),
(27407, 435, 'testimonials_2_content', '<p>I love how easy Zenzio makes it to create great content and share it with my audience. The best part is that I am not stuck creating more content than I have time for.</p>'),
