(27419, 435, 'success_section_content', '<h2>If You’re Not Getting the Likes and Comments You Want - It’s Not Your Fault</h2>\r\nThe truth is, content marketing is a profession all on it’s own.\r\n<ul>\r\n 	<li>You can’t expect to get the results marketing professionals get</li>\r\n 	<li>You’re competing against professional marketers who know the algorithms</li>\r\n 	<li>They’ve been studying, practicing, and “doing” for years and years. And that’s their specialty.</li>\r\n</ul>'),
(27420, 435, '_success_section_content', 'field_63c7fd923e6f8'),
(27421, 435, 'success_section', ''),
(27422, 435, '_success_section', 'field_63c7fd053e6f5'),
(27423, 435, 'now_never_section_image', '400'),
(27424, 435, '_now_never_section_image', 'field_63c80217a675f'),
(27425, 435, 'now_never_section_content', '<h2>Now? Or Never? It’s up to You!</h2>\r\nWith our busy lives, we can forget even the most important things.\r\n\r\nHow many times have you taken a screenshot, made a bookmark, or saved a video? Only for it to be forgotten, lost in a pile of “will check out later” things\r\n\r\nWe don’t want you to forget us, so we want to offer you a no-brainer deal: Sign up today, at no risk - you’ll know within 5 minutes if Zenzio is for you.'),
(27426, 435, '_now_never_section_content', 'field_63c80217a6760'),
(27427, 435, 'now_never_section', ''),
(27428, 435, '_now_never_section', 'field_63c80217a675e'),
(27429, 435, 'content_creation_image', '401'),
(27430, 435, '_content_creation_image', 'field_63c80532fc142'),
(27431, 435, 'content_creation_content', '<h2>We’ve Been Freeing Realtors From Content Creation</h2>\r\nI can still remember the turning point in my career. One night I had probably spent close to 2 hours customizing a canva template, filling in all the content, looking up youtube videos on how to make it better, and making it PERFECT. I remember naively thinking to myself “this could go viral.\r\n\r\nI posted it close to 12AM, then crawled in bed Waking up the next morning, my eyes were barely open as I excitedly typed in the password to my phone and opened the Facebook app to check on how the post did.\r\n<h4>5 likes. 1 comment. From my mother...</h4>'),
(27432, 435, '_content_creation_content', 'field_63c80532fc143'),
(27433, 435, 'content_creation', ''),
(27434, 435, '_content_creation', 'field_63c80532fc141'),
(27435, 435, 'next_level_section_title', 'Take Your Content to the Next Level'),
(27436, 435, '_next_level_section_title', 'field_63c8084d67300'),
(27437, 435, 'next_level_section_hiring_a_social_media_expert', '<table>\r\n<tbody>\r\n<tr>\r\n<th>Hiring a Social Media Expert</th>\r\n<th><img class=\"alignnone size-full wp-image-15\" src=\"http://localhost/zenzio/wp-content/uploads/2023/01/logo.svg\" alt=\"Zenzio\" width=\"227\" height=\"66\" /></th>\r\n</tr>\r\n<tr>\r\n<td>Monthly meetings to review and send them new content ideas</td>\r\n<td>Monthly meetings to review and send them new content ideas</td>\r\n</tr>\r\n<tr>\r\n<td>They create not educate you on best practices or trends</td>\r\n<td>Our marketing experts host strategy calls and send newsletters on content tips and trends</td>\r\n</tr>\r\n<tr>\r\n<td>Learning curve for your designer to understand the real estate industry</td>\r\n<td>Members of our team are active agents and well versed in finance and the mortgage industry</td>\r\n</tr>\r\n<tr>\r\n<td>You need a scheduling platform</td>\r\n<td>Schedule your posts with Zenzio to LinkedIn, Facebook, Instagram, and TikTok. Or join our Managed Plan to have our team handle it.</td>\r\n</tr>\r\n<tr>\r\n<td>$500 - $1,200 a month</td>\r\n<td>Self-service for $47/mo. Social media management for $98/mo.</td>\r\n</tr>\r\n</tbody>\r\n</table>'),
(27438, 435, '_next_level_section_hiring_a_social_media_expert', 'field_63c8085567301'),
(27439, 435, 'next_level_section_zenzio', ''),
(27440, 435, '_next_level_section_zenzio', 'field_63c8092f67302'),
(27441, 435, 'next_level_section', ''),
(27442, 435, '_next_level_section', 'field_63c8081a672ff'),
(27443, 435, 'realtor_section_top_section', '<h2>Zenzio is so Simple a Realtor Trying to Juggle Content <br>Marketing and Full-Time Realty Can do it</h2>\r\n<p>It\'s as easy as 1, 2, 3 - literally. 3 steps is all it takes to free yourself from content marketing <br>forever. And focus on what you do best - Help your clients find homes.</p>'),
(27444, 435, '_realtor_section_top_section', 'field_63c8ddc7b491e'),
(27445, 435, 'realtor_section_realtor_content_0_number', '1'),
(27446, 435, '_realtor_section_realtor_content_0_number', 'field_63c8de41b4920'),
(27447, 435, 'realtor_section_realtor_content_0_icon', '123'),
(27448, 435, '_realtor_section_realtor_content_0_icon', 'field_63c8de54b4921'),
(27449, 435, 'realtor_section_realtor_content_0_title', 'Explore Membership & Seal the Deal'),
(27450, 435, '_realtor_section_realtor_content_0_title', 'field_63c8de65b4922'),
(27451, 435, 'realtor_section_realtor_content_0_content', '<p>You\'ll receive an onboarding email with a personalized video that explains the dashboard and its features.</p>'),
(27452, 435, '_realtor_section_realtor_content_0_content', 'field_63c8de6db4923'),
(27453, 435, 'realtor_section_realtor_content_1_number', '2'),
(27454, 435, '_realtor_section_realtor_content_1_number', 'field_63c8de41b4920'),
(27455, 435, 'realtor_section_realtor_content_1_icon', '122'),
(27456, 435, '_realtor_section_realtor_content_1_icon', 'field_63c8de54b4921'),
(27457, 435, 'realtor_section_realtor_content_1_title', 'Gain Instant Access to your Social Media Content Dreams'),
(27458, 435, '_realtor_section_realtor_content_1_title', 'field_63c8de65b4922'),
(27459, 435, 'realtor_section_realtor_content_1_content', '<p>The content library, email starters, blogs, and listing description generator are all ready for you to use.</p>'),
(27460, 435, '_realtor_section_realtor_content_1_content', 'field_63c8de6db4923'),
(27461, 435, 'realtor_section_realtor_content_2_number', '3'),
(27462, 435, '_realtor_section_realtor_content_2_number', 'field_63c8de41b4920'),
(27463, 435, 'realtor_section_realtor_content_2_icon', '121'),
(27464, 435, '_realtor_section_realtor_content_2_icon', 'field_63c8de54b4921'),
(27465, 435, 'realtor_section_realtor_content_2_title', 'Start Kiltling It Online'),
(27466, 435, '_realtor_section_realtor_content_2_title', 'field_63c8de65b4922'),
(27467, 435, 'realtor_section_realtor_content_2_content', '<p>Schedule your engaging posts, personalize them with your branding, and start generating leads!</p>'),
(27468, 435, '_realtor_section_realtor_content_2_content', 'field_63c8de6db4923'),
(27469, 435, 'realtor_section_realtor_content', '3'),
(27470, 435, '_realtor_section_realtor_content', 'field_63c8ddf6b491f'),
(27471, 435, 'realtor_section', ''),
(27472, 435, '_realtor_section', 'field_63c8dd7db491d'),
(27473, 435, 'realtor_section_bottom_section', 'See how effortless your social media journey will become\r\n\r\n<a class=\"btn btnBig\" href=\"#videoSection\">watch now</a>'),
(27474, 435, '_realtor_section_bottom_section', 'field_63c8e2368ccb2'),
(27475, 435, 'success_section_bottom_content', 'You’re a realtor trying to balance content marketing AND real estate. You just can’t compete, and that’s not your fault.\r\n\r\nThat’s why Zenzio does it for you, without you having to hire an expensive marketing consultancy.\r\n\r\nOur marketing professionals do what an agency would do, at a fraction of the cost. So you can get powerful unique content at the click of a button, without selling your kidney.'),
(27476, 435, '_success_section_bottom_content', 'field_63c90ecbf7adf'),
(27477, 435, 'now_never_section_left_content', '<p>If you find Zenzio isn’t for you, you can cancel anytime with a <span>14-day 100% money-back guarantee</span> - no hassle, no questions asked</p>\r\n<ul>\r\n<li><span>Step 1.</span> Click cancel subscription</li>\r\n<li><span>Step 2.</span> Get your 100% refund</li>\r\n<li><span>Step 3.</span> (There is no step 3)</li>\r\n</ul>\r\n<a href=\"#\" class=\"btn\">Sign Up Now</a>'),
(27478, 435, '_now_never_section_left_content', 'field_63c90fda991ca'),
(27479, 435, 'content_creation_right_content', ''),
(27480, 435, '_content_creation_right_content', 'field_63c910083bbbd'),
(27481, 435, 'now_never_section_bottom_left_content', '<p>If you find Zenzio isn’t for you, you can cancel anytime with a <span>14-day 100% money-back guarantee</span> - no hassle, no questions asked</p>\r\n<ul>\r\n<li><span>Step 1.</span> Click cancel subscription</li>\r\n<li><span>Step 2.</span> Get your 100% refund</li>\r\n<li><span>Step 3.</span> (There is no step 3)</li>\r\n</ul>\r\n<a href=\"#getStartSection\" class=\"btn btnBig\">Sign Up Now</a>'),
(27482, 435, '_now_never_section_bottom_left_content', 'field_63c911b037a55'),
(27483, 435, 'now_never_section_bottom_right_content', '<h3>We want you to be as confident as we are that Zenzio will:</h3>\r\n<ul>\r\n 	<li>Remove the frustrations of content marketing from your life</li>\r\n 	<li>Free you up to spend more time with family and friends</li>\r\n 	<li>Give you more time to focus on what you do best - help your clients find homes!</li>\r\n</ul>'),
(27484, 435, '_now_never_section_bottom_right_content', 'field_63c911bf37a56'),
(27485, 435, 'content_creation_bottom_content', ''),
(27486, 435, '_content_creation_bottom_content', 'field_63c910083bbbd'),
(27487, 435, 'realtor_section_realtor_steps', '<h3>That\'s it!</h3>\r\n<ul>\r\n 	<li>1 steps to save you thousands of hours creating content</li>\r\n 	<li>2 steps to save you from competing with marketing experts</li>\r\n 	<li>3 steps to get you more time with family, and less time being frustrated</li>\r\n</ul>'),
(27488, 435, '_realtor_section_realtor_steps', 'field_63c9230cc1c7e'),
