INSERT INTO `wp_postmeta` (`meta_id`, `post_id`, `meta_key`, `meta_value`) VALUES
(27532, 435, '_our_client', 'field_63c93256e94c9'),
(27533, 435, 'your_sanity_section_top_section', '<h2>Sometimes All You Have to Lose is Your Sanity</h2>\r\nYou don\'t need to drive yourself crazy trying to learn and create content. But, we\'re not\r\ngoing to tell you how to live your life.\r\n\r\n<em>We\'re not going to say you need Zenzio, but what we will tell you is this:</em>'),
(27534, 435, '_your_sanity_section_top_section', 'field_63c938a63de24'),
(27535, 435, 'your_sanity_section_left_section', '<h3>You have a choice to make</h3>\r\n<ul>\r\n 	<li>You can do nothing, and nothing will change</li>\r\n 	<li>You can continue to do it yourself, and maybe something will change</li>\r\n 	<li>Or you can try Zenzio today, risk free, and everything will change</li>\r\n</ul>\r\n<a class=\"btn btnBig\" href=\"#getStartSection\">Sign Up Now</a>'),
(27536, 435, '_your_sanity_section_left_section', 'field_63c938dd3de25'),
(27537, 435, 'your_sanity_section_right_section', 'It\'s all up to you, and whatever you choose, we\'ll be rooting for you!\r\n\r\nIf you\'re ready, click the “Sign up” button below to check Zenzio out risk-free. Remember, if you find Zenzio isn\'t for you, you can cancel anytime.\r\n\r\nWith a 100% money-back NO HASSLE guarantee, for 14 days <span class=\"italic\">(You\'ll know within 5 minutes or less if Zenzio is for you)</span>'),
(27538, 435, '_your_sanity_section_right_section', 'field_63c938eb3de26'),
(27539, 435, 'your_sanity_section', ''),
(27540, 435, '_your_sanity_section', 'field_63c938733de23'),
(27541, 435, 'faq_section_title', 'Have Questions? You\'re in the Right Place'),
(27542, 435, '_faq_section_title', 'field_63c93e90086ef'),
(27543, 435, 'faq_section_faq_list_0_title', 'How do your services work?'),
(27544, 435, '_faq_section_faq_list_0_title', 'field_63c93eb9086f1'),
(27545, 435, 'faq_section_faq_list_0_content', '<p>You get full access to a personalized marketing content platform. Each month get access to new social content all done for you (the graphics, captions, and hashtags).You sync your accounts to start posting and scheduling content. Or with our managed plan, our team will manage your social media by using our content.</p>'),
(27546, 435, '_faq_section_faq_list_0_content', 'field_63c93ec3086f2'),
(27547, 435, 'faq_section_faq_list_1_title', 'How do your packages work?'),
(27548, 435, '_faq_section_faq_list_1_title', 'field_63c93eb9086f1'),
(27549, 435, 'faq_section_faq_list_1_content', '<p>You can subscribe on a monthly basis or join with an annual subscription for the self-service and managed plan.</p>'),
(27550, 435, '_faq_section_faq_list_1_content', 'field_63c93ec3086f2'),
(27551, 435, 'faq_section_faq_list_2_title', 'Can I schedule my posts in advance?'),
(27552, 435, '_faq_section_faq_list_2_title', 'field_63c93eb9086f1'),
(27553, 435, 'faq_section_faq_list_2_content', '<p>Yes, we have a scheduling feature available in the platform where you can set the time and day for each individual post to go out. You\'ll have visibility on scheduled posts that are pending for the upcoming week or month.</p>'),
(27554, 435, '_faq_section_faq_list_2_content', 'field_63c93ec3086f2'),
(27555, 435, 'faq_section_faq_list_3_title', 'Can I edit my captions and hashtags?'),
(27556, 435, '_faq_section_faq_list_3_title', 'field_63c93eb9086f1'),
(27557, 435, 'faq_section_faq_list_3_content', '<p>Yes, you can always make changes to the pre-written captions and hashtags. You can copy it in the dashboard and then paste it into a notepad or respective social media platform, and make the manual changes. <em>(The dashboard doesn\'t currently support text changes in the platform at this time, but we are working on this in the coming months.)</em></p>'),
(27558, 435, '_faq_section_faq_list_3_content', 'field_63c93ec3086f2'),
(27559, 435, 'faq_section_faq_list_4_title', 'Which social media platform does the platform allow me to post to?'),
(27560, 435, '_faq_section_faq_list_4_title', 'field_63c93eb9086f1'),
(27561, 435, 'faq_section_faq_list_4_content', '<p>You can sync up the following accounts: Instagram Business, Facebook Business, and LinkedIn. In the near future Twitter and TikTok.</p>'),
(27562, 435, '_faq_section_faq_list_4_content', 'field_63c93ec3086f2'),
(27563, 435, 'faq_section_faq_list_5_title', 'What are hashtags for?'),
(27564, 435, '_faq_section_faq_list_5_title', 'field_63c93eb9086f1'),
(27565, 435, 'faq_section_faq_list_5_content', '<p>Hashtags help your posts gain visibility as people search for your keywords and related keywords on social media. It helps feed the algorithm but also helps you attract a more niche audience to your posts and profile by attracting</p>'),
(27566, 435, '_faq_section_faq_list_5_content', 'field_63c93ec3086f2'),
(27567, 435, 'faq_section_faq_list_6_title', 'So do I still have to write my captions?'),
(27568, 435, '_faq_section_faq_list_6_title', 'field_63c93eb9086f1'),
(27569, 435, 'faq_section_faq_list_6_content', '<p>Nope, we have the captions and hashtags written for you.</p>'),
(27570, 435, '_faq_section_faq_list_6_content', 'field_63c93ec3086f2'),
(27571, 435, 'faq_section_faq_list_7_title', 'Do I still have to log in and schedule the posts or does someone on the Zenzio team post for me?'),
(27572, 435, '_faq_section_faq_list_7_title', 'field_63c93eb9086f1'),
(27573, 435, 'faq_section_faq_list_7_content', '<p>Depends on the plan you choose, but we can arrange to manage your social media.</p>'),
(27574, 435, '_faq_section_faq_list_7_content', 'field_63c93ec3086f2'),
(27575, 435, 'faq_section_faq_list_8_title', 'Can I customize the posts?'),
(27576, 435, '_faq_section_faq_list_8_title', 'field_63c93eb9086f1'),
(27577, 435, 'faq_section_faq_list_8_content', '<p>At this time, our posts are pre-designed for a more hands off approach. You can customize it by adding in your branding: brokerage logo or headshot. We are always open to feedback on content style.</p>'),
(27578, 435, '_faq_section_faq_list_8_content', 'field_63c93ec3086f2'),
(27579, 435, 'faq_section_faq_list_9_title', 'Do you connect with my CRM for email campaigns? Can you launch the emails from the dashboard?'),
(27580, 435, '_faq_section_faq_list_9_title', 'field_63c93eb9086f1'),
(27581, 435, 'faq_section_faq_list_9_content', '<p>Right now you can copy the template and send them out, our system doesn\'t work as a CRM. It was built as a content platform.</p>'),
(27582, 435, '_faq_section_faq_list_9_content', 'field_63c93ec3086f2'),
(27583, 435, 'faq_section_faq_list_10_title', 'What type of content do you create?'),
(27584, 435, '_faq_section_faq_list_10_title', 'field_63c93eb9086f1'),
(27585, 435, 'faq_section_faq_list_10_content', '<p>Our content is focused on real estate.The topics range from investing, first-time home ownership, how to refinance your mortgage, to even more relatable quotes, and funny memes.</p>'),
(27586, 435, '_faq_section_faq_list_10_content', 'field_63c93ec3086f2'),
(27587, 435, 'faq_section_faq_list_11_title', 'Why are your prices so low?'),
(27588, 435, '_faq_section_faq_list_11_title', 'field_63c93eb9086f1'),
(27589, 435, 'faq_section_faq_list_11_content', '<p>We recognize that marketing can get pricey, and we want to make it affordable to everyone. And because we put technology first behind our product it allows us to bring costs down.</p>'),
(27590, 435, '_faq_section_faq_list_11_content', 'field_63c93ec3086f2'),
(27591, 435, 'faq_section_faq_list_12_title', 'Is the content always accessible?'),
(27592, 435, '_faq_section_faq_list_12_title', 'field_63c93eb9086f1'),
(27593, 435, 'faq_section_faq_list_12_content', '<p>Yes, the content rolls over so you\'ll have access to last month\'s posts.</p>'),
(27594, 435, '_faq_section_faq_list_12_content', 'field_63c93ec3086f2'),
(27595, 435, 'faq_section_faq_list_13_title', 'Does everyone get access to the same content?'),
(27596, 435, '_faq_section_faq_list_13_title', 'field_63c93eb9086f1'),
(27597, 435, 'faq_section_faq_list_13_content', '<p>Yes, but everyone\'s digital audience is unique. It\'s a very low risk that you would post something and then someone else on your team posts the same thing because you have access to a whole library of posts.</p>'),
(27598, 435, '_faq_section_faq_list_13_content', 'field_63c93ec3086f2'),
(27599, 435, 'faq_section_faq_list_14_title', 'Can I add my headshot or logo to the posts?'),
(27600, 435, '_faq_section_faq_list_14_title', 'field_63c93eb9086f1'),
(27601, 435, 'faq_section_faq_list_14_content', '<p>Yes, in your profile in the dashboardyou can upload an image that will be featured on every post.</p>'),
(27602, 435, '_faq_section_faq_list_14_content', 'field_63c93ec3086f2'),
(27603, 435, 'faq_section_faq_list_15_title', 'Who are some of your clients?'),
(27604, 435, '_faq_section_faq_list_15_title', 'field_63c93eb9086f1'),
(27605, 435, 'faq_section_faq_list_15_content', '<p>We have customers all over the US. From Keller Williams, and Coldwell Banker, to Florida\'s First Choice Realty, and a lot of other brokerages.</p>'),
(27606, 435, '_faq_section_faq_list_15_content', 'field_63c93ec3086f2'),
(27607, 435, 'faq_section_faq_list_16_title', 'How do I make sure this is in line with my branding/broker branding?'),
(27608, 435, '_faq_section_faq_list_16_title', 'field_63c93eb9086f1'),
(27609, 435, 'faq_section_faq_list_16_content', '<p>We offer assets in a variety of colors to ensure that your social feed stays consistent to your established branding. If you don’t see the content aligns, reach out to our team.</p>'),
(27610, 435, '_faq_section_faq_list_16_content', 'field_63c93ec3086f2'),
(27611, 435, 'faq_section_faq_list_17_title', 'How often is new content uploaded?'),
(27612, 435, '_faq_section_faq_list_17_title', 'field_63c93eb9086f1'),
(27613, 435, 'faq_section_faq_list_17_content', '<p>Every month we have new content drops. The blogs and emails are on a continual basis.</p>'),
(27614, 435, '_faq_section_faq_list_17_content', 'field_63c93ec3086f2'),
(27615, 435, 'faq_section_faq_list_18_title', 'Do you offer this in Spanish?'),
(27616, 435, '_faq_section_faq_list_18_title', 'field_63c93eb9086f1'),
(27617, 435, 'faq_section_faq_list_18_content', '<p>Yes, starting February 2023 we will have this available.</p>'),
(27618, 435, '_faq_section_faq_list_18_content', 'field_63c93ec3086f2'),
(27619, 435, 'faq_section_faq_list_19_title', 'If I\'m a new real estate agent, is this for me?'),
(27620, 435, '_faq_section_faq_list_19_title', 'field_63c93eb9086f1'),
(27621, 435, 'faq_section_faq_list_19_content', '<p>For new real estate agents, this is perfect, because they can still post valuable content and build a niche following until they get a listing to post about.</p>'),
(27622, 435, '_faq_section_faq_list_19_content', 'field_63c93ec3086f2'),
(27623, 435, 'faq_section_faq_list', '20'),
(27624, 435, '_faq_section_faq_list', 'field_63c93e9b086f0'),
(27625, 435, 'faq_section', ''),
(27626, 435, '_faq_section', 'field_63c93e76086ee'),
