(27811, 436, 'testimonials_2_star', '72'),
(27812, 436, '_testimonials_2_star', 'field_63c7e7daeb430'),
(27813, 436, 'testimonials_2_content', '<p>I love how easy Zenzio makes it to create great content and share it with my audience. The best part is that I am not stuck creating more content than I have time for.</p>'),
