(27849, 436, 'realtor_section_top_section', '<h2>Zenzio is so Simple a Realtor Trying to Juggle Content <br>Marketing and Full-Time Realty Can do it</h2>\r\n<p>It\'s as easy as 1, 2, 3 - literally. 3 steps is all it takes to free yourself from content marketing <br>forever. And focus on what you do best - Help your clients find homes.</p>'),
(27850, 436, '_realtor_section_top_section', 'field_63c8ddc7b491e'),
(27851, 436, 'realtor_section_realtor_content_0_number', '1'),
(27852, 436, '_realtor_section_realtor_content_0_number', 'field_63c8de41b4920'),
(27853, 436, 'realtor_section_realtor_content_0_icon', '123'),
(27854, 436, '_realtor_section_realtor_content_0_icon', 'field_63c8de54b4921'),
(27855, 436, 'realtor_section_realtor_content_0_title', 'Explore Membership & Seal the Deal'),
(27856, 436, '_realtor_section_realtor_content_0_title', 'field_63c8de65b4922'),
(27857, 436, 'realtor_section_realtor_content_0_content', '<p>You\'ll receive an onboarding email with a personalized video that explains the dashboard and its features.</p>'),
(27858, 436, '_realtor_section_realtor_content_0_content', 'field_63c8de6db4923'),
(27859, 436, 'realtor_section_realtor_content_1_number', '2'),
(27860, 436, '_realtor_section_realtor_content_1_number', 'field_63c8de41b4920'),
(27861, 436, 'realtor_section_realtor_content_1_icon', '122'),
(27862, 436, '_realtor_section_realtor_content_1_icon', 'field_63c8de54b4921'),
(27863, 436, 'realtor_section_realtor_content_1_title', 'Gain Instant Access to your Social Media Content Dreams'),
(27864, 436, '_realtor_section_realtor_content_1_title', 'field_63c8de65b4922'),
(27865, 436, 'realtor_section_realtor_content_1_content', '<p>The content library, email starters, blogs, and listing description generator are all ready for you to use.</p>'),
(27866, 436, '_realtor_section_realtor_content_1_content', 'field_63c8de6db4923'),
(27867, 436, 'realtor_section_realtor_content_2_number', '3'),
(27868, 436, '_realtor_section_realtor_content_2_number', 'field_63c8de41b4920'),
(27869, 436, 'realtor_section_realtor_content_2_icon', '121'),
(27870, 436, '_realtor_section_realtor_content_2_icon', 'field_63c8de54b4921'),
(27871, 436, 'realtor_section_realtor_content_2_title', 'Start Kiltling It Online'),
(27872, 436, '_realtor_section_realtor_content_2_title', 'field_63c8de65b4922'),
(27873, 436, 'realtor_section_realtor_content_2_content', '<p>Schedule your engaging posts, personalize them with your branding, and start generating leads!</p>'),
(27874, 436, '_realtor_section_realtor_content_2_content', 'field_63c8de6db4923'),
(27875, 436, 'realtor_section_realtor_content', '3'),
(27876, 436, '_realtor_section_realtor_content', 'field_63c8ddf6b491f'),
(27877, 436, 'realtor_section', ''),
(27878, 436, '_realtor_section', 'field_63c8dd7db491d'),
(27879, 436, 'realtor_section_bottom_section', 'See how effortless your social media journey will become\r\n\r\n<a class=\"btn btnBig\" href=\"#videoSection\">watch now</a>'),
(27880, 436, '_realtor_section_bottom_section', 'field_63c8e2368ccb2'),
(27881, 436, 'success_section_bottom_content', 'You’re a realtor trying to balance content marketing AND real estate. You just can’t compete, and that’s not your fault.\r\n\r\nThat’s why Zenzio does it for you, without you having to hire an expensive marketing consultancy.\r\n\r\nOur marketing professionals do what an agency would do, at a fraction of the cost. So you can get powerful unique content at the click of a button, without selling your kidney.'),
(27882, 436, '_success_section_bottom_content', 'field_63c90ecbf7adf'),
(27883, 436, 'now_never_section_left_content', '<p>If you find Zenzio isn’t for you, you can cancel anytime with a <span>14-day 100% money-back guarantee</span> - no hassle, no questions asked</p>\r\n<ul>\r\n<li><span>Step 1.</span> Click cancel subscription</li>\r\n<li><span>Step 2.</span> Get your 100% refund</li>\r\n<li><span>Step 3.</span> (There is no step 3)</li>\r\n</ul>\r\n<a href=\"#\" class=\"btn\">Sign Up Now</a>'),
(27884, 436, '_now_never_section_left_content', 'field_63c90fda991ca'),
(27885, 436, 'content_creation_right_content', ''),
(27886, 436, '_content_creation_right_content', 'field_63c910083bbbd'),
(27887, 436, 'now_never_section_bottom_left_content', '<p>If you find Zenzio isn’t for you, you can cancel anytime with a <span>14-day 100% money-back guarantee</span> - no hassle, no questions asked</p>\r\n<ul>\r\n<li><span>Step 1.</span> Click cancel subscription</li>\r\n<li><span>Step 2.</span> Get your 100% refund</li>\r\n<li><span>Step 3.</span> (There is no step 3)</li>\r\n</ul>\r\n<a href=\"#getStartSection\" class=\"btn btnBig\">Sign Up Now</a>'),
(27888, 436, '_now_never_section_bottom_left_content', 'field_63c911b037a55'),
(27889, 436, 'now_never_section_bottom_right_content', '<h3>We want you to be as confident as we are that Zenzio will:</h3>\r\n<ul>\r\n 	<li>Remove the frustrations of content marketing from your life</li>\r\n 	<li>Free you up to spend more time with family and friends</li>\r\n 	<li>Give you more time to focus on what you do best - help your clients find homes!</li>\r\n</ul>'),
(27890, 436, '_now_never_section_bottom_right_content', 'field_63c911bf37a56'),
