(28276, 437, '_realtor_section_realtor_content_2_icon', 'field_63c8de54b4921'),
(28277, 437, 'realtor_section_realtor_content_2_title', 'Start Kiltling It Online'),
(28278, 437, '_realtor_section_realtor_content_2_title', 'field_63c8de65b4922'),
(28279, 437, 'realtor_section_realtor_content_2_content', '<p>Schedule your engaging posts, personalize them with your branding, and start generating leads!</p>'),
(28280, 437, '_realtor_section_realtor_content_2_content', 'field_63c8de6db4923'),
(28281, 437, 'realtor_section_realtor_content', '3'),
(28282, 437, '_realtor_section_realtor_content', 'field_63c8ddf6b491f'),
(28283, 437, 'realtor_section', ''),
(28284, 437, '_realtor_section', 'field_63c8dd7db491d'),
(28285, 437, 'realtor_section_bottom_section', 'See how effortless your social media journey will become\r\n\r\n<a class=\"btn btnBig\" href=\"#videoSection\">Watch Now</a>'),
(28286, 437, '_realtor_section_bottom_section', 'field_63c8e2368ccb2'),
(28287, 437, 'success_section_bottom_content', 'You’re a realtor trying to balance content marketing AND real estate. You just can’t compete, and that’s not your fault.\r\n\r\nThat’s why Zenzio does it for you, without you having to hire an expensive marketing consultancy.\r\n\r\nOur marketing professionals do what an agency would do, at a fraction of the cost. So you can get powerful unique content at the click of a button, without selling your kidney.'),
(28288, 437, '_success_section_bottom_content', 'field_63c90ecbf7adf'),
(28289, 437, 'now_never_section_left_content', '<p>If you find Zenzio isn’t for you, you can cancel anytime with a <span>14-day 100% money-back guarantee</span> - no hassle, no questions asked</p>\r\n<ul>\r\n<li><span>Step 1.</span> Click cancel subscription</li>\r\n<li><span>Step 2.</span> Get your 100% refund</li>\r\n<li><span>Step 3.</span> (There is no step 3)</li>\r\n</ul>\r\n<a href=\"#\" class=\"btn\">Sign Up Now</a>'),
(28290, 437, '_now_never_section_left_content', 'field_63c90fda991ca'),
(28291, 437, 'content_creation_right_content', ''),
(28292, 437, '_content_creation_right_content', 'field_63c910083bbbd'),
(28293, 437, 'now_never_section_bottom_left_content', '<p>If you find Zenzio isn’t for you, you can cancel anytime with a <span>14-day 100% money-back guarantee</span> - no hassle, no questions asked</p>\r\n<ul>\r\n<li><span>Step 1.</span> Click cancel subscription</li>\r\n<li><span>Step 2.</span> Get your 100% refund</li>\r\n<li><span>Step 3.</span> (There is no step 3)</li>\r\n</ul>\r\n<a href=\"#getStartSection\" class=\"btn btnBig\">Sign Up Now</a>'),
(28294, 437, '_now_never_section_bottom_left_content', 'field_63c911b037a55'),
(28295, 437, 'now_never_section_bottom_right_content', '<h3>We want you to be as confident as we are that Zenzio will:</h3>\r\n<ul>\r\n 	<li>Remove the frustrations of content marketing from your life</li>\r\n 	<li>Free you up to spend more time with family and friends</li>\r\n 	<li>Give you more time to focus on what you do best - help your clients find homes!</li>\r\n</ul>'),
