(30305, 447, 'now_never_section_content', '<h2>Now? Or Never? It’s up to You!</h2>\r\nWith our busy lives, we can forget even the most important things.\r\n\r\nHow many times have you taken a screenshot, made a bookmark, or saved a video? Only for it to be forgotten, lost in a pile of “will check out later” things\r\n\r\nWe don’t want you to forget us, so we want to offer you a no-brainer deal: Sign up today, at no risk - you’ll know within 5 minutes if Zenzio is for you.'),
(30306, 447, '_now_never_section_content', 'field_63c80217a6760'),
(30307, 447, 'now_never_section', ''),
(30308, 447, '_now_never_section', 'field_63c80217a675e'),
(30309, 447, 'content_creation_image', '401'),
(30310, 447, '_content_creation_image', 'field_63c80532fc142'),
(30311, 447, 'content_creation_content', '<h2>We’ve Been Freeing Realtors From Content Creation</h2>\r\nI can still remember the turning point in my career. One night I had probably spent close to 2 hours customizing a canva template, filling in all the content, looking up youtube videos on how to make it better, and making it PERFECT. I remember naively thinking to myself “this could go viral.\r\n\r\nI posted it close to 12AM, then crawled in bed Waking up the next morning, my eyes were barely open as I excitedly typed in the password to my phone and opened the Facebook app to check on how the post did.\r\n<h4>5 likes. 1 comment. From my mother...</h4>'),
(30312, 447, '_content_creation_content', 'field_63c80532fc143'),
(30313, 447, 'content_creation', ''),
(30314, 447, '_content_creation', 'field_63c80532fc141'),
