INSERT INTO `wp_postmeta` (`meta_id`, `post_id`, `meta_key`, `meta_value`) VALUES
(31019, 455, 'money_back_money_back_info', '<h2>100% risk free, cancel anytime, 14-day money-back guarantee</h2>'),
(31020, 455, '_money_back_money_back_info', 'field_63c9303ee2e23'),
(31021, 455, 'money_back', ''),
(31022, 455, '_money_back', 'field_63c92fe8e2e21'),
(31023, 455, 'our_client_title', '<h2>Try our powerful work management software for free</h2>\r\nSign up for a free two-week trial of Wrike today — no credit card required. '),
(31024, 455, '_our_client_title', 'field_63c93273e94ca'),
(31025, 455, 'our_client_client_list', ''),
(31026, 455, '_our_client_client_list', 'field_63c9327fe94cb'),
(31027, 455, 'our_client', ''),
(31028, 455, '_our_client', 'field_63c93256e94c9'),
(31029, 455, 'your_sanity_section_top_section', '<h2>Sometimes All You Have to Lose is Your Sanity</h2>\r\nYou don\'t need to drive yourself crazy trying to learn and create content. But, we\'re not\r\ngoing to tell you how to live your life.\r\n\r\n<em>We\'re not going to say you need Zenzio, but what we will tell you is this:</em>'),
(31030, 455, '_your_sanity_section_top_section', 'field_63c938a63de24'),
(31031, 455, 'your_sanity_section_left_section', '<h3>You have a choice to make</h3>\r\n<ul>\r\n 	<li>You can do nothing, and nothing will change</li>\r\n 	<li>You can continue to do it yourself, and maybe something will change</li>\r\n 	<li>Or you can try Zenzio today, risk free, and everything will change</li>\r\n</ul>\r\n<a class=\"btn btnBig\" href=\"#getStartSection\">Sign Up Now</a>'),
(31032, 455, '_your_sanity_section_left_section', 'field_63c938dd3de25'),
(31033, 455, 'your_sanity_section_right_section', 'It\'s all up to you, and whatever you choose, we\'ll be rooting for you!\r\n\r\nIf you\'re ready, click the “Sign up” button below to check Zenzio out risk-free. Remember, if you find Zenzio isn\'t for you, you can cancel anytime.\r\n\r\nWith a 100% money-back NO HASSLE guarantee, for 14 days <span class=\"italic\">(You\'ll know within 5 minutes or less if Zenzio is for you)</span>'),
(31034, 455, '_your_sanity_section_right_section', 'field_63c938eb3de26'),
(31035, 455, 'your_sanity_section', ''),
(31036, 455, '_your_sanity_section', 'field_63c938733de23'),
(31037, 455, 'faq_section_title', 'Have Questions? You\'re in the Right Place'),
(31038, 455, '_faq_section_title', 'field_63c93e90086ef'),
(31039, 455, 'faq_section_faq_list_0_title', 'How do your services work?'),
(31040, 455, '_faq_section_faq_list_0_title', 'field_63c93eb9086f1'),
(31041, 455, 'faq_section_faq_list_0_content', '<p>You get full access to a personalized marketing content platform. Each month get access to new social content all done for you (the graphics, captions, and hashtags).You sync your accounts to start posting and scheduling content. Or with our managed plan, our team will manage your social media by using our content.</p>'),
(31042, 455, '_faq_section_faq_list_0_content', 'field_63c93ec3086f2'),
(31043, 455, 'faq_section_faq_list_1_title', 'How do your packages work?'),
(31044, 455, '_faq_section_faq_list_1_title', 'field_63c93eb9086f1'),
(31045, 455, 'faq_section_faq_list_1_content', '<p>You can subscribe on a monthly basis or join with an annual subscription for the self-service and managed plan.</p>'),
(31046, 455, '_faq_section_faq_list_1_content', 'field_63c93ec3086f2'),
(31047, 455, 'faq_section_faq_list_2_title', 'Can I schedule my posts in advance?'),
(31048, 455, '_faq_section_faq_list_2_title', 'field_63c93eb9086f1'),
(31049, 455, 'faq_section_faq_list_2_content', '<p>Yes, we have a scheduling feature available in the platform where you can set the time and day for each individual post to go out. You\'ll have visibility on scheduled posts that are pending for the upcoming week or month.</p>'),
(31050, 455, '_faq_section_faq_list_2_content', 'field_63c93ec3086f2'),
(31051, 455, 'faq_section_faq_list_3_title', 'Can I edit my captions and hashtags?'),
(31052, 455, '_faq_section_faq_list_3_title', 'field_63c93eb9086f1'),
(31053, 455, 'faq_section_faq_list_3_content', '<p>Yes, you can always make changes to the pre-written captions and hashtags. You can copy it in the dashboard and then paste it into a notepad or respective social media platform, and make the manual changes. <em>(The dashboard doesn\'t currently support text changes in the platform at this time, but we are working on this in the coming months.)</em></p>'),
(31054, 455, '_faq_section_faq_list_3_content', 'field_63c93ec3086f2'),
(31055, 455, 'faq_section_faq_list_4_title', 'Which social media platform does the platform allow me to post to?'),
(31056, 455, '_faq_section_faq_list_4_title', 'field_63c93eb9086f1'),
(31057, 455, 'faq_section_faq_list_4_content', '<p>You can sync up the following accounts: Instagram Business, Facebook Business, and LinkedIn. In the near future Twitter and TikTok.</p>'),
(31058, 455, '_faq_section_faq_list_4_content', 'field_63c93ec3086f2'),
(31059, 455, 'faq_section_faq_list_5_title', 'What are hashtags for?'),
(31060, 455, '_faq_section_faq_list_5_title', 'field_63c93eb9086f1'),
(31061, 455, 'faq_section_faq_list_5_content', '<p>Hashtags help your posts gain visibility as people search for your keywords and related keywords on social media. It helps feed the algorithm but also helps you attract a more niche audience to your posts and profile by attracting</p>'),
(31062, 455, '_faq_section_faq_list_5_content', 'field_63c93ec3086f2'),
