(31347, 467, '_realtor_section_realtor_content_0_title', 'field_63c8de65b4922'),
(31348, 467, 'realtor_section_realtor_content_0_content', '<p>You\'ll receive an onboarding email with a personalized video that explains the dashboard and its features.</p>'),
(31349, 467, '_realtor_section_realtor_content_0_content', 'field_63c8de6db4923'),
(31350, 467, 'realtor_section_realtor_content_1_number', '2'),
