(31886, 468, 'customers_stories_title', '<h2>Stories from our customers</h2>'),
(31887, 468, '_customers_stories_title', 'field_64520a4ad9c19'),
(31888, 468, 'customers_stories_customer_content_0_image', '465'),
(31889, 468, '_customers_stories_customer_content_0_image', 'field_64520ab6d9c1b'),
(31890, 468, 'customers_stories_customer_content_0_content', '\"Everyone is in Wrike daily, we’ve built one story and one version of the truth. And that is a game changer for us. Now we do our project reviews in Wrike: no more need for presentations, word documents, or any of this additional work.\"'),
(31891, 468, '_customers_stories_customer_content_0_content', 'field_64520ac5d9c1c'),
(31892, 468, 'customers_stories_customer_content_0_name', 'Francis Lalonde, Vice President of Transportation, Walmart Canada'),
(31893, 468, '_customers_stories_customer_content_0_name', 'field_64520adad9c1d'),
(31894, 468, 'customers_stories_customer_content_1_image', '463'),
(31895, 468, '_customers_stories_customer_content_1_image', 'field_64520ab6d9c1b'),
(31896, 468, 'customers_stories_customer_content_1_content', '“The moment our teams saw Wrike, we heard a resounding \'yes\' – it was the one system that met each and every one of our team’s comprehensive and complex requirements.“'),
(31897, 468, '_customers_stories_customer_content_1_content', 'field_64520ac5d9c1c'),
(31898, 468, 'customers_stories_customer_content_1_name', 'Sherrie Besecker, Creative Technology Manager at Syneos Health'),
(31899, 468, '_customers_stories_customer_content_1_name', 'field_64520adad9c1d'),
(31900, 468, 'customers_stories_customer_content_2_image', '464'),
(31901, 468, '_customers_stories_customer_content_2_image', 'field_64520ab6d9c1b'),
(31902, 468, 'customers_stories_customer_content_2_content', '\"I\'m thankful for Wrike. It\'s a fast-paced world, and we\'re all trying to keep up. Wrike helps me do just that.\"'),
(31903, 468, '_customers_stories_customer_content_2_content', 'field_64520ac5d9c1c'),
(31904, 468, 'customers_stories_customer_content_2_name', 'Kyle Bartlett, Director of Marketing and Advertising at the Texas Rangers'),
(31905, 468, '_customers_stories_customer_content_2_name', 'field_64520adad9c1d'),
(31906, 468, 'customers_stories_customer_content_3_image', '462'),
(31907, 468, '_customers_stories_customer_content_3_image', 'field_64520ab6d9c1b'),
(31908, 468, 'customers_stories_customer_content_3_content', '“Wrike helps us collaborate in the best possible way, and it gives our teams the support they need to work better. We could roll out a tool on a global scale, and we were also able to offer a secure and an integrated tool.”'),
(31909, 468, '_customers_stories_customer_content_3_content', 'field_64520ac5d9c1c'),
(31910, 468, 'customers_stories_customer_content_3_name', 'Hannes Leitner, Process Owner at Siemens Smart Infrastructure'),
(31911, 468, '_customers_stories_customer_content_3_name', 'field_64520adad9c1d'),
(31912, 468, 'customers_stories_customer_content_4_image', '466'),
(31913, 468, '_customers_stories_customer_content_4_image', 'field_64520ab6d9c1b'),
(31914, 468, 'customers_stories_customer_content_4_content', '\"Everyone is in Wrike daily, we’ve built one story and one version of the truth. And that is a game changer for us. Now we do our project reviews in Wrike: no more need for presentations, word documents, or any of this additional work.\"'),
(31915, 468, '_customers_stories_customer_content_4_content', 'field_64520ac5d9c1c'),
