(32243, 469, '_customers_stories_customer_content_0_image', 'field_64520ab6d9c1b'),
(32244, 469, 'customers_stories_customer_content_0_content', '\"Everyone is in Wrike daily, we’ve built one story and one version of the truth. And that is a game changer for us. Now we do our project reviews in Wrike: no more need for presentations, word documents, or any of this additional work.\"'),
(32245, 469, '_customers_stories_customer_content_0_content', 'field_64520ac5d9c1c'),
(32246, 469, 'customers_stories_customer_content_0_name', 'Francis Lalonde, Vice President of Transportation, Walmart Canada'),
(32247, 469, '_customers_stories_customer_content_0_name', 'field_64520adad9c1d'),
(32248, 469, 'customers_stories_customer_content_1_image', '463'),
(32249, 469, '_customers_stories_customer_content_1_image', 'field_64520ab6d9c1b'),
(32250, 469, 'customers_stories_customer_content_1_content', '“The moment our teams saw Wrike, we heard a resounding \'yes\' – it was the one system that met each and every one of our team’s comprehensive and complex requirements.“'),
(32251, 469, '_customers_stories_customer_content_1_content', 'field_64520ac5d9c1c'),
(32252, 469, 'customers_stories_customer_content_1_name', 'Sherrie Besecker, Creative Technology Manager at Syneos Health'),
(32253, 469, '_customers_stories_customer_content_1_name', 'field_64520adad9c1d'),
(32254, 469, 'customers_stories_customer_content_2_image', '464'),
(32255, 469, '_customers_stories_customer_content_2_image', 'field_64520ab6d9c1b'),
(32256, 469, 'customers_stories_customer_content_2_content', '\"I\'m thankful for Wrike. It\'s a fast-paced world, and we\'re all trying to keep up. Wrike helps me do just that.\"'),
(32257, 469, '_customers_stories_customer_content_2_content', 'field_64520ac5d9c1c'),
(32258, 469, 'customers_stories_customer_content_2_name', 'Kyle Bartlett, Director of Marketing and Advertising at the Texas Rangers'),
(32259, 469, '_customers_stories_customer_content_2_name', 'field_64520adad9c1d'),
(32260, 469, 'customers_stories_customer_content_3_image', '462'),
(32261, 469, '_customers_stories_customer_content_3_image', 'field_64520ab6d9c1b'),
(32262, 469, 'customers_stories_customer_content_3_content', '“Wrike helps us collaborate in the best possible way, and it gives our teams the support they need to work better. We could roll out a tool on a global scale, and we were also able to offer a secure and an integrated tool.”'),
(32263, 469, '_customers_stories_customer_content_3_content', 'field_64520ac5d9c1c'),
