(32470, 470, 'faq_section_faq_list_0_title', 'How do your services work?'),
(32471, 470, '_faq_section_faq_list_0_title', 'field_63c93eb9086f1'),
(32472, 470, 'faq_section_faq_list_0_content', '<p>You get full access to a personalized marketing content platform. Each month get access to new social content all done for you (the graphics, captions, and hashtags).You sync your accounts to start posting and scheduling content. Or with our managed plan, our team will manage your social media by using our content.</p>'),
(32473, 470, '_faq_section_faq_list_0_content', 'field_63c93ec3086f2'),
(32474, 470, 'faq_section_faq_list_1_title', 'How do your packages work?'),
(32475, 470, '_faq_section_faq_list_1_title', 'field_63c93eb9086f1'),
(32476, 470, 'faq_section_faq_list_1_content', '<p>You can subscribe on a monthly basis or join with an annual subscription for the self-service and managed plan.</p>'),
(32477, 470, '_faq_section_faq_list_1_content', 'field_63c93ec3086f2'),
