INSERT INTO `wp_postmeta` (`meta_id`, `post_id`, `meta_key`, `meta_value`) VALUES
(32479, 470, '_faq_section_faq_list_2_title', 'field_63c93eb9086f1'),
(32480, 470, 'faq_section_faq_list_2_content', '<p>Yes, we have a scheduling feature available in the platform where you can set the time and day for each individual post to go out. You\'ll have visibility on scheduled posts that are pending for the upcoming week or month.</p>'),
(32481, 470, '_faq_section_faq_list_2_content', 'field_63c93ec3086f2'),
(32482, 470, 'faq_section_faq_list_3_title', 'Can I edit my captions and hashtags?'),
(32483, 470, '_faq_section_faq_list_3_title', 'field_63c93eb9086f1'),
(32484, 470, 'faq_section_faq_list_3_content', '<p>Yes, you can always make changes to the pre-written captions and hashtags. You can copy it in the dashboard and then paste it into a notepad or respective social media platform, and make the manual changes. <em>(The dashboard doesn\'t currently support text changes in the platform at this time, but we are working on this in the coming months.)</em></p>'),
(32485, 470, '_faq_section_faq_list_3_content', 'field_63c93ec3086f2'),
(32486, 470, 'faq_section_faq_list_4_title', 'Which social media platform does the platform allow me to post to?'),
(32487, 470, '_faq_section_faq_list_4_title', 'field_63c93eb9086f1'),
(32488, 470, 'faq_section_faq_list_4_content', '<p>You can sync up the following accounts: Instagram Business, Facebook Business, and LinkedIn. In the near future Twitter and TikTok.</p>'),
(32489, 470, '_faq_section_faq_list_4_content', 'field_63c93ec3086f2'),
(32490, 470, 'faq_section_faq_list_5_title', 'What are hashtags for?'),
(32491, 470, '_faq_section_faq_list_5_title', 'field_63c93eb9086f1'),
(32492, 470, 'faq_section_faq_list_5_content', '<p>Hashtags help your posts gain visibility as people search for your keywords and related keywords on social media. It helps feed the algorithm but also helps you attract a more niche audience to your posts and profile by attracting</p>'),
