(32786, 472, '_realtor_section_realtor_content_2_title', 'field_63c8de65b4922'),
(32787, 472, 'realtor_section_realtor_content_2_content', '<p>Schedule your engaging posts, personalize them with your branding, and start generating leads!</p>'),
(32788, 472, '_realtor_section_realtor_content_2_content', 'field_63c8de6db4923'),
(32789, 472, 'realtor_section_realtor_content', '3'),
(32790, 472, '_realtor_section_realtor_content', 'field_63c8ddf6b491f'),
(32791, 472, 'realtor_section', ''),
(32792, 472, '_realtor_section', 'field_63c8dd7db491d'),
(32793, 472, 'realtor_section_bottom_section', 'See how effortless your social media journey will become\r\n\r\n<a class=\"btn btnBig\" href=\"#videoSection\">Watch Now</a>'),
(32794, 472, '_realtor_section_bottom_section', 'field_63c8e2368ccb2'),
(32795, 472, 'success_section_bottom_content', 'You’re a realtor trying to balance content marketing AND real estate. You just can’t compete, and that’s not your fault.\r\n\r\nThat’s why Zenzio does it for you, without you having to hire an expensive marketing consultancy.\r\n\r\nOur marketing professionals do what an agency would do, at a fraction of the cost. So you can get powerful unique content at the click of a button, without selling your kidney.'),
(32796, 472, '_success_section_bottom_content', 'field_63c90ecbf7adf'),
(32797, 472, 'now_never_section_left_content', '<p>If you find Zenzio isn’t for you, you can cancel anytime with a <span>14-day 100% money-back guarantee</span> - no hassle, no questions asked</p>\r\n<ul>\r\n<li><span>Step 1.</span> Click cancel subscription</li>\r\n<li><span>Step 2.</span> Get your 100% refund</li>\r\n<li><span>Step 3.</span> (There is no step 3)</li>\r\n</ul>\r\n<a href=\"#\" class=\"btn\">Sign Up Now</a>'),
(32798, 472, '_now_never_section_left_content', 'field_63c90fda991ca'),
(32799, 472, 'content_creation_right_content', ''),
(32800, 472, '_content_creation_right_content', 'field_63c910083bbbd'),
(32801, 472, 'now_never_section_bottom_left_content', '<p>If you find Zenzio isn’t for you, you can cancel anytime with a <span>14-day 100% money-back guarantee</span> - no hassle, no questions asked</p>\r\n<ul>\r\n<li><span>Step 1.</span> Click cancel subscription</li>\r\n<li><span>Step 2.</span> Get your 100% refund</li>\r\n<li><span>Step 3.</span> (There is no step 3)</li>\r\n</ul>\r\n<a href=\"#getStartSection\" class=\"btn btnBig\">Sign Up Now</a>'),
(32802, 472, '_now_never_section_bottom_left_content', 'field_63c911b037a55'),
(32803, 472, 'now_never_section_bottom_right_content', '<h3>We want you to be as confident as we are that Zenzio will:</h3>\r\n<ul>\r\n 	<li>Remove the frustrations of content marketing from your life</li>\r\n 	<li>Free you up to spend more time with family and friends</li>\r\n 	<li>Give you more time to focus on what you do best - help your clients find homes!</li>\r\n</ul>'),
(32804, 472, '_now_never_section_bottom_right_content', 'field_63c911bf37a56'),
