(32955, 472, 'customers_stories_title', '<h2>Stories from our customers</h2>'),
(32956, 472, '_customers_stories_title', 'field_64520a4ad9c19'),
(32957, 472, 'customers_stories_customer_content_0_image', '465'),
(32958, 472, '_customers_stories_customer_content_0_image', 'field_64520ab6d9c1b'),
(32959, 472, 'customers_stories_customer_content_0_content', '\"Everyone is in Wrike daily, we’ve built one story and one version of the truth. And that is a game changer for us. Now we do our project reviews in Wrike: no more need for presentations, word documents, or any of this additional work.\"'),
(32960, 472, '_customers_stories_customer_content_0_content', 'field_64520ac5d9c1c'),
(32961, 472, 'customers_stories_customer_content_0_name', 'Francis Lalonde, Vice President of Transportation, Walmart Canada'),
(32962, 472, '_customers_stories_customer_content_0_name', 'field_64520adad9c1d'),
(32963, 472, 'customers_stories_customer_content_1_image', '463'),
(32964, 472, '_customers_stories_customer_content_1_image', 'field_64520ab6d9c1b'),
(32965, 472, 'customers_stories_customer_content_1_content', '“The moment our teams saw Wrike, we heard a resounding \'yes\' – it was the one system that met each and every one of our team’s comprehensive and complex requirements.“'),
(32966, 472, '_customers_stories_customer_content_1_content', 'field_64520ac5d9c1c'),
(32967, 472, 'customers_stories_customer_content_1_name', 'Sherrie Besecker, Creative Technology Manager at Syneos Health'),
(32968, 472, '_customers_stories_customer_content_1_name', 'field_64520adad9c1d'),
(32969, 472, 'customers_stories_customer_content_2_image', '464'),
(32970, 472, '_customers_stories_customer_content_2_image', 'field_64520ab6d9c1b'),
(32971, 472, 'customers_stories_customer_content_2_content', '\"I\'m thankful for Wrike. It\'s a fast-paced world, and we\'re all trying to keep up. Wrike helps me do just that.\"'),
(32972, 472, '_customers_stories_customer_content_2_content', 'field_64520ac5d9c1c'),
(32973, 472, 'customers_stories_customer_content_2_name', 'Kyle Bartlett, Director of Marketing and Advertising at the Texas Rangers'),
(32974, 472, '_customers_stories_customer_content_2_name', 'field_64520adad9c1d'),
(32975, 472, 'customers_stories_customer_content_3_image', '462'),
(32976, 472, '_customers_stories_customer_content_3_image', 'field_64520ab6d9c1b'),
(32977, 472, 'customers_stories_customer_content_3_content', '“Wrike helps us collaborate in the best possible way, and it gives our teams the support they need to work better. We could roll out a tool on a global scale, and we were also able to offer a secure and an integrated tool.”'),
(32978, 472, '_customers_stories_customer_content_3_content', 'field_64520ac5d9c1c'),
(32979, 472, 'customers_stories_customer_content_3_name', 'Hannes Leitner, Process Owner at Siemens Smart Infrastructure'),
