(33191, 473, 'faq_section_faq_list_1_title', 'How do your packages work?'),
(33192, 473, '_faq_section_faq_list_1_title', 'field_63c93eb9086f1'),
(33193, 473, 'faq_section_faq_list_1_content', '<p>You can subscribe on a monthly basis or join with an annual subscription for the self-service and managed plan.</p>'),
(33194, 473, '_faq_section_faq_list_1_content', 'field_63c93ec3086f2'),
(33195, 473, 'faq_section_faq_list_2_title', 'Can I schedule my posts in advance?'),
(33196, 473, '_faq_section_faq_list_2_title', 'field_63c93eb9086f1'),
(33197, 473, 'faq_section_faq_list_2_content', '<p>Yes, we have a scheduling feature available in the platform where you can set the time and day for each individual post to go out. You\'ll have visibility on scheduled posts that are pending for the upcoming week or month.</p>'),
(33198, 473, '_faq_section_faq_list_2_content', 'field_63c93ec3086f2'),
(33199, 473, 'faq_section_faq_list_3_title', 'Can I edit my captions and hashtags?'),
(33200, 473, '_faq_section_faq_list_3_title', 'field_63c93eb9086f1'),
(33201, 473, 'faq_section_faq_list_3_content', '<p>Yes, you can always make changes to the pre-written captions and hashtags. You can copy it in the dashboard and then paste it into a notepad or respective social media platform, and make the manual changes. <em>(The dashboard doesn\'t currently support text changes in the platform at this time, but we are working on this in the coming months.)</em></p>'),
(33202, 473, '_faq_section_faq_list_3_content', 'field_63c93ec3086f2'),
(33203, 473, 'faq_section_faq_list_4_title', 'Which social media platform does the platform allow me to post to?'),
(33204, 473, '_faq_section_faq_list_4_title', 'field_63c93eb9086f1'),
(33205, 473, 'faq_section_faq_list_4_content', '<p>You can sync up the following accounts: Instagram Business, Facebook Business, and LinkedIn. In the near future Twitter and TikTok.</p>'),
(33206, 473, '_faq_section_faq_list_4_content', 'field_63c93ec3086f2'),
(33207, 473, 'faq_section_faq_list_5_title', 'What are hashtags for?'),
(33208, 473, '_faq_section_faq_list_5_title', 'field_63c93eb9086f1'),
(33209, 473, 'faq_section_faq_list_5_content', '<p>Hashtags help your posts gain visibility as people search for your keywords and related keywords on social media. It helps feed the algorithm but also helps you attract a more niche audience to your posts and profile by attracting</p>'),
(33210, 473, '_faq_section_faq_list_5_content', 'field_63c93ec3086f2'),
