(33311, 473, 'customers_stories_title', '<h2>Stories from our customers</h2>'),
(33312, 473, '_customers_stories_title', 'field_64520a4ad9c19'),
(33313, 473, 'customers_stories_customer_content_0_image', '465'),
(33314, 473, '_customers_stories_customer_content_0_image', 'field_64520ab6d9c1b'),
(33315, 473, 'customers_stories_customer_content_0_content', '\"Everyone is in Wrike daily, we’ve built one story and one version of the truth. And that is a game changer for us. Now we do our project reviews in Wrike: no more need for presentations, word documents, or any of this additional work.\"'),
(33316, 473, '_customers_stories_customer_content_0_content', 'field_64520ac5d9c1c'),
(33317, 473, 'customers_stories_customer_content_0_name', 'Francis Lalonde, Vice President of Transportation, Walmart Canada'),
(33318, 473, '_customers_stories_customer_content_0_name', 'field_64520adad9c1d'),
(33319, 473, 'customers_stories_customer_content_1_image', '463'),
(33320, 473, '_customers_stories_customer_content_1_image', 'field_64520ab6d9c1b'),
(33321, 473, 'customers_stories_customer_content_1_content', '“The moment our teams saw Wrike, we heard a resounding \'yes\' – it was the one system that met each and every one of our team’s comprehensive and complex requirements.“'),
(33322, 473, '_customers_stories_customer_content_1_content', 'field_64520ac5d9c1c'),
(33323, 473, 'customers_stories_customer_content_1_name', 'Sherrie Besecker, Creative Technology Manager at Syneos Health'),
(33324, 473, '_customers_stories_customer_content_1_name', 'field_64520adad9c1d'),
(33325, 473, 'customers_stories_customer_content_2_image', '464'),
(33326, 473, '_customers_stories_customer_content_2_image', 'field_64520ab6d9c1b'),
(33327, 473, 'customers_stories_customer_content_2_content', '\"I\'m thankful for Wrike. It\'s a fast-paced world, and we\'re all trying to keep up. Wrike helps me do just that.\"'),
(33328, 473, '_customers_stories_customer_content_2_content', 'field_64520ac5d9c1c'),
(33329, 473, 'customers_stories_customer_content_2_name', 'Kyle Bartlett, Director of Marketing and Advertising at the Texas Rangers'),
(33330, 473, '_customers_stories_customer_content_2_name', 'field_64520adad9c1d'),
(33331, 473, 'customers_stories_customer_content_3_image', '462'),
(33332, 473, '_customers_stories_customer_content_3_image', 'field_64520ab6d9c1b'),
(33333, 473, 'customers_stories_customer_content_3_content', '“Wrike helps us collaborate in the best possible way, and it gives our teams the support they need to work better. We could roll out a tool on a global scale, and we were also able to offer a secure and an integrated tool.”'),
(33334, 473, '_customers_stories_customer_content_3_content', 'field_64520ac5d9c1c'),
(33335, 473, 'customers_stories_customer_content_3_name', 'Hannes Leitner, Process Owner at Siemens Smart Infrastructure'),
(33336, 473, '_customers_stories_customer_content_3_name', 'field_64520adad9c1d'),
(33337, 473, 'customers_stories_customer_content_4_image', '466'),
(33338, 473, '_customers_stories_customer_content_4_image', 'field_64520ab6d9c1b'),
(33339, 473, 'customers_stories_customer_content_4_content', '\"Everyone is in Wrike daily, we’ve built one story and one version of the truth. And that is a game changer for us. Now we do our project reviews in Wrike: no more need for presentations, word documents, or any of this additional work.\"'),
(33340, 473, '_customers_stories_customer_content_4_content', 'field_64520ac5d9c1c'),
(33341, 473, 'customers_stories_customer_content_4_name', 'Mikhail Naliuhin, Account Director, inDrive'),
(33342, 473, '_customers_stories_customer_content_4_name', 'field_64520adad9c1d'),
