(33687, 481, 'customers_stories_customer_content_1_content', '“The moment our teams saw Wrike, we heard a resounding \'yes\' – it was the one system that met each and every one of our team’s comprehensive and complex requirements.“'),
(33688, 481, '_customers_stories_customer_content_1_content', 'field_64520ac5d9c1c'),
(33689, 481, 'customers_stories_customer_content_1_name', 'Sherrie Besecker, Creative Technology Manager at Syneos Health'),
(33690, 481, '_customers_stories_customer_content_1_name', 'field_64520adad9c1d'),
(33691, 481, 'customers_stories_customer_content_2_image', '464'),
(33692, 481, '_customers_stories_customer_content_2_image', 'field_64520ab6d9c1b'),
(33693, 481, 'customers_stories_customer_content_2_content', '\"I\'m thankful for Wrike. It\'s a fast-paced world, and we\'re all trying to keep up. Wrike helps me do just that.\"'),
(33694, 481, '_customers_stories_customer_content_2_content', 'field_64520ac5d9c1c'),
(33695, 481, 'customers_stories_customer_content_2_name', 'Kyle Bartlett, Director of Marketing and Advertising at the Texas Rangers'),
(33696, 481, '_customers_stories_customer_content_2_name', 'field_64520adad9c1d'),
(33697, 481, 'customers_stories_customer_content_3_image', '462'),
(33698, 481, '_customers_stories_customer_content_3_image', 'field_64520ab6d9c1b'),
(33699, 481, 'customers_stories_customer_content_3_content', '“Wrike helps us collaborate in the best possible way, and it gives our teams the support they need to work better. We could roll out a tool on a global scale, and we were also able to offer a secure and an integrated tool.”'),
(33700, 481, '_customers_stories_customer_content_3_content', 'field_64520ac5d9c1c'),
