(33871, 482, 'realtor_section_bottom_section', 'See how effortless your social media journey will become\r\n\r\n<a class=\"btn btnBig\" href=\"#videoSection\">Watch Now</a>'),
(33872, 482, '_realtor_section_bottom_section', 'field_63c8e2368ccb2'),
(33873, 482, 'success_section_bottom_content', 'You’re a realtor trying to balance content marketing AND real estate. You just can’t compete, and that’s not your fault.\r\n\r\nThat’s why Zenzio does it for you, without you having to hire an expensive marketing consultancy.\r\n\r\nOur marketing professionals do what an agency would do, at a fraction of the cost. So you can get powerful unique content at the click of a button, without selling your kidney.'),
(33874, 482, '_success_section_bottom_content', 'field_63c90ecbf7adf'),
(33875, 482, 'now_never_section_left_content', '<p>If you find Zenzio isn’t for you, you can cancel anytime with a <span>14-day 100% money-back guarantee</span> - no hassle, no questions asked</p>\r\n<ul>\r\n<li><span>Step 1.</span> Click cancel subscription</li>\r\n<li><span>Step 2.</span> Get your 100% refund</li>\r\n<li><span>Step 3.</span> (There is no step 3)</li>\r\n</ul>\r\n<a href=\"#\" class=\"btn\">Sign Up Now</a>'),
(33876, 482, '_now_never_section_left_content', 'field_63c90fda991ca'),
(33877, 482, 'content_creation_right_content', ''),
(33878, 482, '_content_creation_right_content', 'field_63c910083bbbd'),
(33879, 482, 'now_never_section_bottom_left_content', '<p>If you find Zenzio isn’t for you, you can cancel anytime with a <span>14-day 100% money-back guarantee</span> - no hassle, no questions asked</p>\r\n<ul>\r\n<li><span>Step 1.</span> Click cancel subscription</li>\r\n<li><span>Step 2.</span> Get your 100% refund</li>\r\n<li><span>Step 3.</span> (There is no step 3)</li>\r\n</ul>\r\n<a href=\"#getStartSection\" class=\"btn btnBig\">Sign Up Now</a>'),
(33880, 482, '_now_never_section_bottom_left_content', 'field_63c911b037a55'),
(33881, 482, 'now_never_section_bottom_right_content', '<h3>We want you to be as confident as we are that Zenzio will:</h3>\r\n<ul>\r\n 	<li>Remove the frustrations of content marketing from your life</li>\r\n 	<li>Free you up to spend more time with family and friends</li>\r\n 	<li>Give you more time to focus on what you do best - help your clients find homes!</li>\r\n</ul>'),
