(34971, 494, 'our_client', ''),
(34972, 494, '_our_client', 'field_63c93256e94c9'),
(34973, 494, 'your_sanity_section_top_section', '<h2>Sometimes All You Have to Lose is Your Sanity</h2>\r\nYou don\'t need to drive yourself crazy trying to learn and create content. But, we\'re not\r\ngoing to tell you how to live your life.\r\n\r\n<em>We\'re not going to say you need Zenzio, but what we will tell you is this:</em>'),
(34974, 494, '_your_sanity_section_top_section', 'field_63c938a63de24'),
(34975, 494, 'your_sanity_section_left_section', '<h3>You have a choice to make</h3>\r\n<ul>\r\n 	<li>You can do nothing, and nothing will change</li>\r\n 	<li>You can continue to do it yourself, and maybe something will change</li>\r\n 	<li>Or you can try Zenzio today, risk free, and everything will change</li>\r\n</ul>\r\n<a class=\"btn btnBig\" href=\"#getStartSection\">Sign Up Now</a>'),
(34976, 494, '_your_sanity_section_left_section', 'field_63c938dd3de25'),
(34977, 494, 'your_sanity_section_right_section', 'It\'s all up to you, and whatever you choose, we\'ll be rooting for you!\r\n\r\nIf you\'re ready, click the “Sign up” button below to check Zenzio out risk-free. Remember, if you find Zenzio isn\'t for you, you can cancel anytime.\r\n\r\nWith a 100% money-back NO HASSLE guarantee, for 14 days <span class=\"italic\">(You\'ll know within 5 minutes or less if Zenzio is for you)</span>'),
(34978, 494, '_your_sanity_section_right_section', 'field_63c938eb3de26'),
(34979, 494, 'your_sanity_section', ''),
(34980, 494, '_your_sanity_section', 'field_63c938733de23'),
(34981, 494, 'faq_section_title', 'Have Questions? You\'re in the Right Place'),
(34982, 494, '_faq_section_title', 'field_63c93e90086ef'),
(34983, 494, 'faq_section_faq_list_0_title', 'How do your services work?'),
(34984, 494, '_faq_section_faq_list_0_title', 'field_63c93eb9086f1'),
(34985, 494, 'faq_section_faq_list_0_content', '<p>You get full access to a personalized marketing content platform. Each month get access to new social content all done for you (the graphics, captions, and hashtags).You sync your accounts to start posting and scheduling content. Or with our managed plan, our team will manage your social media by using our content.</p>'),
(34986, 494, '_faq_section_faq_list_0_content', 'field_63c93ec3086f2'),
(34987, 494, 'faq_section_faq_list_1_title', 'How do your packages work?'),
(34988, 494, '_faq_section_faq_list_1_title', 'field_63c93eb9086f1'),
(34989, 494, 'faq_section_faq_list_1_content', '<p>You can subscribe on a monthly basis or join with an annual subscription for the self-service and managed plan.</p>'),
(34990, 494, '_faq_section_faq_list_1_content', 'field_63c93ec3086f2'),
(34991, 494, 'faq_section_faq_list_2_title', 'Can I schedule my posts in advance?'),
(34992, 494, '_faq_section_faq_list_2_title', 'field_63c93eb9086f1'),
(34993, 494, 'faq_section_faq_list_2_content', '<p>Yes, we have a scheduling feature available in the platform where you can set the time and day for each individual post to go out. You\'ll have visibility on scheduled posts that are pending for the upcoming week or month.</p>'),
(34994, 494, '_faq_section_faq_list_2_content', 'field_63c93ec3086f2'),
(34995, 494, 'faq_section_faq_list_3_title', 'Can I edit my captions and hashtags?'),
(34996, 494, '_faq_section_faq_list_3_title', 'field_63c93eb9086f1'),
(34997, 494, 'faq_section_faq_list_3_content', '<p>Yes, you can always make changes to the pre-written captions and hashtags. You can copy it in the dashboard and then paste it into a notepad or respective social media platform, and make the manual changes. <em>(The dashboard doesn\'t currently support text changes in the platform at this time, but we are working on this in the coming months.)</em></p>'),
(34998, 494, '_faq_section_faq_list_3_content', 'field_63c93ec3086f2'),
(34999, 494, 'faq_section_faq_list_4_title', 'Which social media platform does the platform allow me to post to?'),
(35000, 494, '_faq_section_faq_list_4_title', 'field_63c93eb9086f1'),
(35001, 494, 'faq_section_faq_list_4_content', '<p>You can sync up the following accounts: Instagram Business, Facebook Business, and LinkedIn. In the near future Twitter and TikTok.</p>'),
(35002, 494, '_faq_section_faq_list_4_content', 'field_63c93ec3086f2'),
(35003, 494, 'faq_section_faq_list_5_title', 'What are hashtags for?'),
(35004, 494, '_faq_section_faq_list_5_title', 'field_63c93eb9086f1'),
(35005, 494, 'faq_section_faq_list_5_content', '<p>Hashtags help your posts gain visibility as people search for your keywords and related keywords on social media. It helps feed the algorithm but also helps you attract a more niche audience to your posts and profile by attracting</p>'),
(35006, 494, '_faq_section_faq_list_5_content', 'field_63c93ec3086f2'),
