(35265, 497, 'now_never_section_content', '<h2>Now? Or Never? It’s up to You!</h2>\r\nWith our busy lives, we can forget even the most important things.\r\n\r\nHow many times have you taken a screenshot, made a bookmark, or saved a video? Only for it to be forgotten, lost in a pile of “will check out later” things\r\n\r\nWe don’t want you to forget us, so we want to offer you a no-brainer deal: Sign up today, at no risk - you’ll know within 5 minutes if Zenzio is for you.'),
(35266, 497, '_now_never_section_content', 'field_63c80217a6760'),
(35267, 497, 'now_never_section', ''),
(35268, 497, '_now_never_section', 'field_63c80217a675e'),
(35269, 497, 'content_creation_image', '401'),
(35270, 497, '_content_creation_image', 'field_63c80532fc142'),
(35271, 497, 'content_creation_content', '<h2>We’ve Been Freeing Realtors From Content Creation</h2>\r\nI can still remember the turning point in my career. One night I had probably spent close to 2 hours customizing a canva template, filling in all the content, looking up youtube videos on how to make it better, and making it PERFECT. I remember naively thinking to myself “this could go viral.\r\n\r\nI posted it close to 12AM, then crawled in bed Waking up the next morning, my eyes were barely open as I excitedly typed in the password to my phone and opened the Facebook app to check on how the post did.'),
(35272, 497, '_content_creation_content', 'field_63c80532fc143'),
