(35350, 497, '_faq_section_title', 'field_63c93e90086ef'),
(35351, 497, 'faq_section_faq_list_0_title', 'How do your services work?'),
(35352, 497, '_faq_section_faq_list_0_title', 'field_63c93eb9086f1'),
(35353, 497, 'faq_section_faq_list_0_content', '<p>You get full access to a personalized marketing content platform. Each month get access to new social content all done for you (the graphics, captions, and hashtags).You sync your accounts to start posting and scheduling content. Or with our managed plan, our team will manage your social media by using our content.</p>'),
(35354, 497, '_faq_section_faq_list_0_content', 'field_63c93ec3086f2'),
(35355, 497, 'faq_section_faq_list_1_title', 'How do your packages work?'),
(35356, 497, '_faq_section_faq_list_1_title', 'field_63c93eb9086f1'),
(35357, 497, 'faq_section_faq_list_1_content', '<p>You can subscribe on a monthly basis or join with an annual subscription for the self-service and managed plan.</p>'),
(35358, 497, '_faq_section_faq_list_1_content', 'field_63c93ec3086f2'),
(35359, 497, 'faq_section_faq_list_2_title', 'Can I schedule my posts in advance?'),
(35360, 497, '_faq_section_faq_list_2_title', 'field_63c93eb9086f1'),
(35361, 497, 'faq_section_faq_list_2_content', '<p>Yes, we have a scheduling feature available in the platform where you can set the time and day for each individual post to go out. You\'ll have visibility on scheduled posts that are pending for the upcoming week or month.</p>'),
(35362, 497, '_faq_section_faq_list_2_content', 'field_63c93ec3086f2'),
(35363, 497, 'faq_section_faq_list_3_title', 'Can I edit my captions and hashtags?'),
(35364, 497, '_faq_section_faq_list_3_title', 'field_63c93eb9086f1'),
(35365, 497, 'faq_section_faq_list_3_content', '<p>Yes, you can always make changes to the pre-written captions and hashtags. You can copy it in the dashboard and then paste it into a notepad or respective social media platform, and make the manual changes. <em>(The dashboard doesn\'t currently support text changes in the platform at this time, but we are working on this in the coming months.)</em></p>'),
(35366, 497, '_faq_section_faq_list_3_content', 'field_63c93ec3086f2'),
(35367, 497, 'faq_section_faq_list_4_title', 'Which social media platform does the platform allow me to post to?'),
(35368, 497, '_faq_section_faq_list_4_title', 'field_63c93eb9086f1'),
(35369, 497, 'faq_section_faq_list_4_content', '<p>You can sync up the following accounts: Instagram Business, Facebook Business, and LinkedIn. In the near future Twitter and TikTok.</p>'),
(35370, 497, '_faq_section_faq_list_4_content', 'field_63c93ec3086f2'),
(35371, 497, 'faq_section_faq_list_5_title', 'What are hashtags for?'),
