(35472, 497, '_customers_stories_title', 'field_64520a4ad9c19'),
(35473, 497, 'customers_stories_customer_content_0_image', '465'),
(35474, 497, '_customers_stories_customer_content_0_image', 'field_64520ab6d9c1b'),
(35475, 497, 'customers_stories_customer_content_0_content', '\"Everyone is in Wrike daily, we’ve built one story and one version of the truth. And that is a game changer for us. Now we do our project reviews in Wrike: no more need for presentations, word documents, or any of this additional work.\"'),
(35476, 497, '_customers_stories_customer_content_0_content', 'field_64520ac5d9c1c'),
(35477, 497, 'customers_stories_customer_content_0_name', 'Francis Lalonde, Vice President of Transportation, Walmart Canada'),
(35478, 497, '_customers_stories_customer_content_0_name', 'field_64520adad9c1d'),
(35479, 497, 'customers_stories_customer_content_1_image', '463'),
(35480, 497, '_customers_stories_customer_content_1_image', 'field_64520ab6d9c1b'),
(35481, 497, 'customers_stories_customer_content_1_content', '“The moment our teams saw Wrike, we heard a resounding \'yes\' – it was the one system that met each and every one of our team’s comprehensive and complex requirements.“'),
(35482, 497, '_customers_stories_customer_content_1_content', 'field_64520ac5d9c1c'),
(35483, 497, 'customers_stories_customer_content_1_name', 'Sherrie Besecker, Creative Technology Manager at Syneos Health'),
(35484, 497, '_customers_stories_customer_content_1_name', 'field_64520adad9c1d'),
(35485, 497, 'customers_stories_customer_content_2_image', '464'),
(35486, 497, '_customers_stories_customer_content_2_image', 'field_64520ab6d9c1b'),
(35487, 497, 'customers_stories_customer_content_2_content', '\"I\'m thankful for Wrike. It\'s a fast-paced world, and we\'re all trying to keep up. Wrike helps me do just that.\"'),
(35488, 497, '_customers_stories_customer_content_2_content', 'field_64520ac5d9c1c'),
(35489, 497, 'customers_stories_customer_content_2_name', 'Kyle Bartlett, Director of Marketing and Advertising at the Texas Rangers'),
(35490, 497, '_customers_stories_customer_content_2_name', 'field_64520adad9c1d'),
(35491, 497, 'customers_stories_customer_content_3_image', '462'),
(35492, 497, '_customers_stories_customer_content_3_image', 'field_64520ab6d9c1b'),
(35493, 497, 'customers_stories_customer_content_3_content', '“Wrike helps us collaborate in the best possible way, and it gives our teams the support they need to work better. We could roll out a tool on a global scale, and we were also able to offer a secure and an integrated tool.”'),
(35494, 497, '_customers_stories_customer_content_3_content', 'field_64520ac5d9c1c'),
(35495, 497, 'customers_stories_customer_content_3_name', 'Hannes Leitner, Process Owner at Siemens Smart Infrastructure'),
