(35627, 498, 'success_section_content', '<h2>If You’re Not Getting the Likes and Comments You Want - It’s Not Your Fault</h2>\r\nThe truth is, content marketing is a profession all on it’s own.\r\n<ul>\r\n 	<li>You can’t expect to get the results marketing professionals get</li>\r\n 	<li>You’re competing against professional marketers who know the algorithms</li>\r\n 	<li>They’ve been studying, practicing, and “doing” for years and years. And that’s their specialty.</li>\r\n</ul>'),
(35628, 498, '_success_section_content', 'field_63c7fd923e6f8'),
(35629, 498, 'success_section', ''),
(35630, 498, '_success_section', 'field_63c7fd053e6f5'),
(35631, 498, 'now_never_section_image', '400'),
(35632, 498, '_now_never_section_image', 'field_63c80217a675f'),
(35633, 498, 'now_never_section_content', '<h2>Now? Or Never? It’s up to You!</h2>\r\nWith our busy lives, we can forget even the most important things.\r\n\r\nHow many times have you taken a screenshot, made a bookmark, or saved a video? Only for it to be forgotten, lost in a pile of “will check out later” things\r\n\r\nWe don’t want you to forget us, so we want to offer you a no-brainer deal: Sign up today, at no risk - you’ll know within 5 minutes if Zenzio is for you.'),
(35634, 498, '_now_never_section_content', 'field_63c80217a6760'),
(35635, 498, 'now_never_section', ''),
(35636, 498, '_now_never_section', 'field_63c80217a675e'),
(35637, 498, 'content_creation_image', '401'),
(35638, 498, '_content_creation_image', 'field_63c80532fc142'),
(35639, 498, 'content_creation_content', '<h2>We’ve Been Freeing Realtors From Content Creation</h2>\r\nI can still remember the turning point in my career. One night I had probably spent close to 2 hours customizing a canva template, filling in all the content, looking up youtube videos on how to make it better, and making it PERFECT. I remember naively thinking to myself “this could go viral.\r\n\r\nI posted it close to 12AM, then crawled in bed Waking up the next morning, my eyes were barely open as I excitedly typed in the password to my phone and opened the Facebook app to check on how the post did.'),
(35640, 498, '_content_creation_content', 'field_63c80532fc143'),
(35641, 498, 'content_creation', ''),
(35642, 498, '_content_creation', 'field_63c80532fc141'),
