(35718, 498, '_faq_section_title', 'field_63c93e90086ef'),
(35719, 498, 'faq_section_faq_list_0_title', 'How do your services work?'),
(35720, 498, '_faq_section_faq_list_0_title', 'field_63c93eb9086f1'),
(35721, 498, 'faq_section_faq_list_0_content', '<p>You get full access to a personalized marketing content platform. Each month get access to new social content all done for you (the graphics, captions, and hashtags).You sync your accounts to start posting and scheduling content. Or with our managed plan, our team will manage your social media by using our content.</p>'),
(35722, 498, '_faq_section_faq_list_0_content', 'field_63c93ec3086f2'),
(35723, 498, 'faq_section_faq_list_1_title', 'How do your packages work?'),
(35724, 498, '_faq_section_faq_list_1_title', 'field_63c93eb9086f1'),
(35725, 498, 'faq_section_faq_list_1_content', '<p>You can subscribe on a monthly basis or join with an annual subscription for the self-service and managed plan.</p>'),
(35726, 498, '_faq_section_faq_list_1_content', 'field_63c93ec3086f2'),
(35727, 498, 'faq_section_faq_list_2_title', 'Can I schedule my posts in advance?'),
(35728, 498, '_faq_section_faq_list_2_title', 'field_63c93eb9086f1'),
(35729, 498, 'faq_section_faq_list_2_content', '<p>Yes, we have a scheduling feature available in the platform where you can set the time and day for each individual post to go out. You\'ll have visibility on scheduled posts that are pending for the upcoming week or month.</p>'),
(35730, 498, '_faq_section_faq_list_2_content', 'field_63c93ec3086f2'),
(35731, 498, 'faq_section_faq_list_3_title', 'Can I edit my captions and hashtags?'),
(35732, 498, '_faq_section_faq_list_3_title', 'field_63c93eb9086f1'),
(35733, 498, 'faq_section_faq_list_3_content', '<p>Yes, you can always make changes to the pre-written captions and hashtags. You can copy it in the dashboard and then paste it into a notepad or respective social media platform, and make the manual changes. <em>(The dashboard doesn\'t currently support text changes in the platform at this time, but we are working on this in the coming months.)</em></p>'),
(35734, 498, '_faq_section_faq_list_3_content', 'field_63c93ec3086f2'),
(35735, 498, 'faq_section_faq_list_4_title', 'Which social media platform does the platform allow me to post to?'),
(35736, 498, '_faq_section_faq_list_4_title', 'field_63c93eb9086f1'),
(35737, 498, 'faq_section_faq_list_4_content', '<p>You can sync up the following accounts: Instagram Business, Facebook Business, and LinkedIn. In the near future Twitter and TikTok.</p>'),
(35738, 498, '_faq_section_faq_list_4_content', 'field_63c93ec3086f2'),
(35739, 498, 'faq_section_faq_list_5_title', 'What are hashtags for?'),
(35740, 498, '_faq_section_faq_list_5_title', 'field_63c93eb9086f1'),
(35741, 498, 'faq_section_faq_list_5_content', '<p>Hashtags help your posts gain visibility as people search for your keywords and related keywords on social media. It helps feed the algorithm but also helps you attract a more niche audience to your posts and profile by attracting</p>'),
