(36217, 502, 'customers_stories_customer_content_0_content', '\"Everyone is in Wrike daily, we’ve built one story and one version of the truth. And that is a game changer for us. Now we do our project reviews in Wrike: no more need for presentations, word documents, or any of this additional work.\"'),
(36218, 502, '_customers_stories_customer_content_0_content', 'field_64520ac5d9c1c'),
