(36233, 502, 'customers_stories_customer_content_3_image', '462'),
(36234, 502, '_customers_stories_customer_content_3_image', 'field_64520ab6d9c1b'),
(36235, 502, 'customers_stories_customer_content_3_content', '“Wrike helps us collaborate in the best possible way, and it gives our teams the support they need to work better. We could roll out a tool on a global scale, and we were also able to offer a secure and an integrated tool.”'),
