(36706, 506, '_testimonials_0_star', 'field_63c7e7daeb430'),
(36707, 506, 'testimonials_0_content', '<p>I highly recommend Zenzio for agents on the go. I\'ve been using it for about a month now and it has been helping me with lead generation and keeping my social media fresh.</p>'),
