(36782, 506, '_realtor_section_realtor_content_1_title', 'field_63c8de65b4922'),
(36783, 506, 'realtor_section_realtor_content_1_content', '<p>The content library, email starters, blogs, and listing description generator are all ready for you to use.</p>'),
(36784, 506, '_realtor_section_realtor_content_1_content', 'field_63c8de6db4923'),
