(36955, 506, 'customers_stories_title', '<h2>Stories from our customers</h2>'),
(36956, 506, '_customers_stories_title', 'field_64520a4ad9c19'),
(36957, 506, 'customers_stories_customer_content_0_image', '465'),
(36958, 506, '_customers_stories_customer_content_0_image', 'field_64520ab6d9c1b'),
(36959, 506, 'customers_stories_customer_content_0_content', '\"Everyone is in Wrike daily, we’ve built one story and one version of the truth. And that is a game changer for us. Now we do our project reviews in Wrike: no more need for presentations, word documents, or any of this additional work.\"'),
(36960, 506, '_customers_stories_customer_content_0_content', 'field_64520ac5d9c1c'),
(36961, 506, 'customers_stories_customer_content_0_name', 'Francis Lalonde, Vice President of Transportation, Walmart Canada'),
(36962, 506, '_customers_stories_customer_content_0_name', 'field_64520adad9c1d'),
(36963, 506, 'customers_stories_customer_content_1_image', '463'),
(36964, 506, '_customers_stories_customer_content_1_image', 'field_64520ab6d9c1b'),
(36965, 506, 'customers_stories_customer_content_1_content', '“The moment our teams saw Wrike, we heard a resounding \'yes\' – it was the one system that met each and every one of our team’s comprehensive and complex requirements.“'),
(36966, 506, '_customers_stories_customer_content_1_content', 'field_64520ac5d9c1c'),
(36967, 506, 'customers_stories_customer_content_1_name', 'Sherrie Besecker, Creative Technology Manager at Syneos Health'),
(36968, 506, '_customers_stories_customer_content_1_name', 'field_64520adad9c1d'),
(36969, 506, 'customers_stories_customer_content_2_image', '464'),
(36970, 506, '_customers_stories_customer_content_2_image', 'field_64520ab6d9c1b'),
(36971, 506, 'customers_stories_customer_content_2_content', '\"I\'m thankful for Wrike. It\'s a fast-paced world, and we\'re all trying to keep up. Wrike helps me do just that.\"'),
