(37558, 508, '_money_back', 'field_63c92fe8e2e21'),
(37559, 508, 'our_client_title', '<h2>Try our powerful work management software for free</h2>\r\nSign up for a free two-week trial of Wrike today — no credit card required. '),
(37560, 508, '_our_client_title', 'field_63c93273e94ca'),
